lected but not fully configured. Please use the "Authorize" button on the %1$sCDN%2$s settings page to connect a pull zone.'=>'W3 Total Cache heeft gedetecteerd dat BunnyCDN is geselecteerd maar niet volledig is geconfigureerd. Gebruik de "Autoriseer" knop op de %1$sCDN%2$s instellingen pagina om een pull zone te verbinden.','Create the %1$s%2$s%3$s file and paste the following text into it: %4$s%5$s%6$s'=>'Maak het bestand %1$s%2$s%3$s en plak de volgende tekst erin: %4$s%5$s%6$s','%1$schmod 777 %2$s%3$s'=>'%1$schmod 777 %2$s%3$s','%1$s<br />then %2$s.'=>'%1$s<br />dan %2$s.','%1$s%2$s%3$s could not be created, %1$sopen_basedir%3$s restriction in effect, please check your php.ini settings:%4$sopen_basedir = "%5$s"%3$s'=>'%1$s%2$s%3$s kon niet worden aangemaakt, %1$sopen_basedir%3$s beperking van kracht, controleer je php.ini instellingen:%4$sopen_basedir = "%5$s"%3$s','%1$s%2$s%3$s could not be created, please run following command:%4$s%5$s'=>'%1$s%2$s%3$s kon niet worden aangemaakt, voer het volgende commando uit: %4$s%5$s','Help'=>'Hulp','Enabling this will schedule a WP-Cron event that will flush all enabled Caches via a single cron job. Each cache\'s advanced settings page features similar settings to this if you wish to schedule purges for specific caches only. If you prefer to use a system cron job instead of WP-Cron, you can schedule the following command to run at your desired interval: "wp w3tc flush all". If the Always Cached extension is active and enabled, page cache entries will instead be added to the queue instead of being purged from the cache. Visit %1$shere%2$s for more information.'=>'Als je dit inschakelt, wordt er een WP-Cron event ingepland dat alle ingeschakelde caches doorspoelt via een enkele cron taak. De pagina geavanceerde instellingen van elke cache bevat soortgelijke instellingen als deze als je opschonen alleen voor specifieke caches wilt plannen. Als je liever een cron taak van het systeem gebruikt in plaats van WP-Cron, kun je het volgende commando plannen om op je gewenste interval uit te voeren: "wp w3tc flush all". Als de extensie always cached actief en ingeschakeld is, worden invoergegevens uit de pagina cache toegevoegd aan de wachtrij in plaats van te worden opgeschoond uit de cache. Bezoek %1$shier%2$s voor meer informatie.','Return'=>'Terug','Ask a question'=>'Stel een vraag','View all questions in Page Cache forum'=>'Bekijk alle vragen in het Page Cache forum','View all questions in Object Cache forum'=>'Bekijk alle vragen in Object Cache forum','View all questions in Minify Cache forum'=>'Bekijk alle vragen in Minify Cache forum','View all questions in Database Cache forum'=>'Bekijk alle vragen in Database Cache forum','View all questions in Browser Cache forum'=>'Bekijk alle vragen in Browser Cache forum','This setting controls the initial start time of the cron job. If the selected time has already passed, it will schedule the job for the following day at the selected time.'=>'Deze instelling bepaalt de initiële starttijd van de cron taak. Als de geselecteerde tijd al voorbij is, wordt de taak op de geselecteerde tijd voor de volgende dag ingepland.','Object Cache Settings Guide'=>'Handleiding instellingen Object Cache','Minify Cache Settings Guide'=>'Handleiding voor instellingen voor Minify Cache','Full Site Delivery with Bunny CDN'=>'Full Site Delivery met Bunny CDN','Enhancing WordPress Performance with Full Site Delivery (FSD)'=>'WordPress prestaties verbeteren met Full Site Delivery (FSD)','View all questions in the CDN forum'=>'Bekijk alle vragen in het CDN forum','Popular questions from the forums'=>'Populaire vragen van de forums','in the forums. It may show up here!'=>'in de forums. Het kan hier verschijnen!','Page has been flushed successfully'=>'Pagina is succesvol opgeschoond','How to configure Browser Cache'=>'Hoe de browsercache te configureren','How to configure Cloudflare with W3 Total Cache'=>'Hoe Cloudflare te configureren met W3 Total Cache','How to set up Data