De wachtrij is leeg.','View'=>'Bekijken','n/a'=>'n/b','Regenerate All'=>'Alles opnieuw genereren','Exclusions:'=>'Uitsluitingen:','Clear Queue'=>'Wachtrij wissen','This button will manually trigger the queue processor to begin regenerating the cache entry for each item in the queue, thereby publishing all pending changes.'=>'Deze knop activeert handmatig de wachtrij processor om te beginnen met het regenereren van de invoer in de cache voor elk item in de wachtrij, waardoor alle hangende wijzigingen worden gepubliceerd.','When viewing the queue, each entry will have a circular arrow icon that can be clicked to manually regenerate the corresponding cache entry. Once this completes, the queue entry will be removed from the queue.'=>'Bij het bekijken van de wachtrij heeft elke invoer een icoon met een ronde pijl waarop geklikt kan worden om de overeenkomstige invoer in de cache handmatig te regenereren. Zodra dit afgerond is, wordt de invoer in de wachtrij verwijderd uit de wachtrij.','This button removes all items in the queue. The pending changes for each removed item will not be published until the corresponding existing cache entry expires. Removed items can be re-added to the queue via further modifications to the item or a flush all caches operation with the "Queue Purge All Requests" option enabled.'=>'Deze knop verwijdert alle items in de wachtrij. De hangende wijzigingen voor elk verwijderd item worden niet gepubliceerd totdat de corresponderende bestaande invoer in de cache verloopt. Verwijderde items kunnen opnieuw toegevoegd worden aan de wachtrij via verdere wijzigingen aan het item of een flush all caches operatie met de "Wachtrij opschonen alle aanvragen" optie ingeschakeld.','Postponed in queue:'=>'Uitgesteld in wachtrij:','Pending in queue:'=>'In afwachting van wachtrij:','Last processed:'=>'Laatst verwerkt:','%1$s%2$s ago%3$s'=>'%1$s%2$s geleden%3$s','Queue'=>'Wachtrij','Homepage'=>'Homepage','Number of Latest Posts:'=>'Aantal laatste berichten:','This setting controls whether the homepage should be added to the queue when a flush all operation occurs.'=>'Deze instelling bepaalt of de homepage moet worden toegevoegd aan de wachtrij wanneer een alles doorspoelen bewerking plaatsvindt.','This setting controls the number of latest pages that will be added to the queue when a flush all operation occurs. If this field is left blank it will default to the latest 15 pages.'=>'Deze instelling bepaalt het aantal laatste pagina\'s dat aan de wachtrij wordt toegevoegd wanneer een alles opschonen bewerking plaatsvindt. Als dit veld leeg wordt gelaten, wordt standaard uitgegaan van de laatste 15 pagina\'s.','With this enabled, the "Purge All Caches" action will instead queue items based on the below settings. If this is NOT enabled, the "Flush All" action will purge all caches and clear all queue entries as pending changes will be applied. Note that enabling this can cause the "Flush All" action to take longer, especially if the "Number of Latests Pages/Posts" are set at a high value.'=>'Als dit is ingeschakeld, zal de actie "Opschonen alle caches" in plaats daarvan items in de wachtrij plaatsen op basis van de onderstaande instellingen. Als dit NIET is ingeschakeld, zal de actie "Alles opschonen" alle caches opschonen en alle invoer in de wachtrij wissen omdat hangende wijzigingen zullen worden toegepast. Let op dat het inschakelen van deze optie ervoor kan zorgen dat de actie "Alles opschonen" langer duurt, vooral als het "Aantal laatste pagina\'s/berichten" op een hoge waarde is ingesteld.','The "Postponed in queue" represent pages/posts that failed to process either due to an error or due to the queue processor exceeding its allocated time slot. These entries will be processed on the next scheduled queue processor execution.'=>'De "Uitgesteld in wachtrij" vertegenwoordigen pagina\'s/berichten die niet konden worden verwerkt door een fout of doordat de wachtrij verwerker het toegewezen tijdslot overschreed. Deze invoer wordt verwerkt bij de volgende geplande uitvoering van de wachtrij processor.','The "Pending in queue" represent pages/posts that have been updated but are still serving the pre-update cache entry.'=>'De "Pending in queue" staan voor pagina\'s/berichten die geüpdatet zijn, maar nog steeds de invoer van de pre-update cache serveren.','The "Last processed" represents the last time the queue processor was executed.'=>'De "Laatst verwerkt" staat voor de laatste keer dat de wachtrij processor werd uitgevoerd.','When Queue is processed, regenerate:'=>'Regenereer wanneer de wachtrij is verwerkt:','This setting controls the number of latest posts that will be added to the queue when a flush all operation occurs. If this field is left blank it will default to the latest 15 posts.'=>'Deze instelling bepaalt het aantal laatste berichten dat wordt toegevoegd aan de wachtrij wanneer alles wordt doorgespoeld. Als dit veld leeg wordt gelaten, wordt standaard uitgegaan van de laatste 15 berichten.','Number of Latest Pages:'=>'Aantal laatste pagina\'s:','Weekly'=>'Wekelijks','Twice Daily'=>'Tweemaal per dag','Interval'=>'Interval','Hourly'=>'Elk uur','Daily'=>'Dagelijks','This setting controls the interval that the cron job should occur.'=>'Deze instelling bepaalt het interval waarin de cron job moet plaatsvinden.','Queue Purge All Requests'=>'Wachtrij opschonen alle aanvragen','Purge All Behavior'=>'Alle gedrag opschonen','Enabling this will schedule a WP-Cron event that will process the queue and regenerate cache files. If you prefer to use a system cron job instead of WP-Cron, you can schedule the following command to run at your desired interval: "wp w3tc alwayscached_process".'=>'Als je dit inschakelt, plan je een WP-Cron gebeurtenis die de wachtrij verwerkt en cachebestanden regenereert. Als je liever een cron taak van het systeem gebruikt in plaats van WP-Cron, kun je het volgende commando plannen om met je gewenste interval uit te voeren: "wp w3tc alwayscached_process".','Sear