rect Content-Type header for %1$sXML%2$s files (e.g., feeds and sitemaps).'=>'Geeft correcte content-type header voor %1$sXML%2$s bestanden (bijv. feeds en sitemaps).','Potential API Response Time Gain'=>'Potentiële toename in API reactietijd','Only applies to pages, posts, and custom post types whose status transitioned from a non-published status to the "published" status.'=>'Geldt alleen voor pagina\'s, berichten en extra berichttypen waarvan de status is overgegaan van een niet-gepubliceerde status naar de status "gepubliceerd".','Object Cache debug info:'=>'Object cache debug info:','No W3TC API key provided for revoke!'=>'Geen W3TC API-sleutel voor herroepen!','No W3TC API key provided for access key refresh!'=>'Geen W3TC API-sleutel beschikbaar voor sleutel verversen!','No site ID provided for access key refresh!'=>'Geen site ID verstrekt voor verversen sleutel!','No access token provided for revoke!'=>'Geen toegang token beschikbaar voor herroepen!','Max interval is limited by the %1$s constant (%2$s seconds) which can be overridden in wp-config.php.'=>'Het maximale interval wordt beperkt door de constante %1$s (%2$s seconden) die kan worden overschreven in wp-config.php.','In a recent test, enabling REST API Caching increased API response times by 84&#37;!'=>'In een recente test verhoogde het inschakelen van REST API caching de responstijden van API\'s met 84&#37!','In a recent test, Eliminating render blocking CSS improved our Google PageSpeed score by over 17 points on mobile devices!'=>'In een recente test verbeterde het elimineren van render blokkerende CSS onze Google PageSpeed score met meer dan 17 punten op mobiele apparaten!','Google PageSpeed access token revocation missing required parameters!'=>'Google PageSpeed toegang token revocation mist vereiste parameters!','Google PageSpeed Access Token revocation failed.'=>'Google PageSpeed toegang token herroeping mislukt.','Google PageSpeed access token refresh missing required parameters!'=>'Google PageSpeed toegang token refresh mist vereiste parameters!','Google PageSpeed access token refresh failed.'=>'Vernieuwen van Google PageSpeed toegang token mislukt.','Google PageSpeed access token refresh failed due to response missing access token.'=>'Vernieuwen toegang token Google PageSpeed mislukt door ontbrekende toegang token in reactie.','Enter one server definition per line: e.g. 127.0.0.1:6379 or domain.com:6379. To use TLS, prefix server with tls://'=>'Voer één serverdefinitie per regel in: bijv. 127.0.0.1:6379 of domain.com:6379. Voorvoegsel server met tls:// om TLS te gebruiken','Determines the natural expiration time of cache items. The higher the value, the larger the cache.'=>'Bepaalt de natuurlijke vervaltijd van items in de cache. Hoe hoger de waarde, hoe groter de cache.','Applies after updating any page, post, or custom post type with the final status being "published".'=>'Wordt toegepast na het updaten van een pagina, bericht of extra berichttype met als eindstatus "gepubliceerd".','API Response Time'=>'API reactietijd','No Google access token found during Google authorization return processing!'=>'Geen Google toegang token gevonden tijdens de verwerking van het Google autorisatie retour!','Warning: Disk-Based Object Caching Selected'=>'Waarschuwing: schijfgebaseerde object caching geselecteerd','Comparing Disk, Redis, and Memcached: Understanding Caching Solutions'=>'Schijf, Redis en Memcached vergelijken: caching oplossingen begrijpen','Include'=>'Opnemen','Exclude'=>'Uitsluiten','View Examples'=>'Bekijk voorbeelden','Points'=>'Punten','Action:'=>'Actie:','Warning: Disk-Based Database Caching Selected'=>'Waarschuwing: schijf gebaseerde database caching geselecteerd','Improves page caching interoperability with WPML and TranslatePress.'=>'Verbetert de interoperabiliteit van pagina caching met WPML en TranslatePress.','Empty match pattern!'=>'Leeg match patroon!','%1$sFree license users will have a conversion limit of %2$d per hour and %3$d per month