regel op, bijv. (https://cdn.domain.com, https://fonts.googleapis.com, https://www.google-ananlytics.com, enz.)','Specify domains that browsers should preconnect to. Include one entry per line, e.g. (https://cdn.domain.com, https://fonts.googleapis.com, https://www.google-ananlytics.com, etc.)'=>'Geef domeinen op waarmee browsers vooraf verbinding moeten maken. Neem één invoer per regel op, bijv. (https://cdn.domain.com, https://fonts.googleapis.com, https://www.google-ananlytics.com, enz.)','Remove list:'=>'Lijst verwijderen:','Remove CSS/JS On Homepage'=>'CSS/JS verwijderen op homepage','Remove CSS/JS Individually'=>'CSS/JS afzonderlijk verwijderen','Preload Videos:'=>'Vooraf laden van video\'s:','Preload JavaScript:'=>'Vooraf laden van JavaScript:','Preload Images:'=>'Vooraf laden afbeeldingen:','Preload Documents:'=>'Documenten vooraf laden:','Preconnect Domains:'=>'Domeinen vooraf verbinden:','However, it\'s important to note a significant caveat: if a webpage requires connections to numerous third-party domains, indiscriminate pre-connecting to all of them can actually hinder performance. Pre-connecting to an excessive number of domains can overwhelm the browser and degrade overall speed, as each connection consumes resources. It\'s crucial for web developers to judiciously implement pre-connecting, considering the optimal number and relevance of third-party domains to ensure efficient website loading.'=>'Het is echter belangrijk om op een belangrijk voorbehoud te letten: als een webpagina verbindingen met een groot aantal domeinen van derden nodig heeft, kan het lukraak vooraf verbinden met al deze domeinen de prestaties belemmeren. Vooraf verbinden met een buitensporig aantal domeinen kan de browser overweldigen en de algehele snelheid verlagen, omdat elke verbinding gegevensbronnen verbruikt. Het is cruciaal voor webontwikkelaars om vooraf verbinding te maken, waarbij ze het optimale aantal en de relevantie van domeinen van derden in overweging nemen om de site efficiënt te laden.','DNS prefetching, pre-connecting, and preloading are essential web optimization techniques that enhance website performance by proactively resolving network-related tasks. DNS prefetching involves resolving domain names to IP addresses before they are needed, reducing the time it takes for the browser to initiate a connection. Pre-connecting establishes early connections to servers to expedite resource fetching, anticipating the need for subsequent requests. Preloading involves instructing the browser to fetch and cache critical resources in advance, ensuring a smoother user experience during page load.'=>'DNS prefetching, pre-connecting en vooraf laden zijn essentiële weboptimalisatietechnieken die de prestaties van sites verbeteren door proactief netwerkgerelateerde taken op te lossen. DNS prefetching omvat het oplossen van domeinnamen naar IP-adressen voordat ze nodig zijn, waardoor de browser minder tijd nodig heeft om een verbinding te maken. Pre-connecting maakt vroegtijdige verbindingen met servers om het ophalen van gegevensbronnen te versnellen en te anticiperen op de noodzaak van volgende aanvragen. Vooraf laden omvat het instrueren van de browser om kritieke gegevensbronnen van tevoren op te halen en in de cache op te slaan, zodat de gebruikerservaring tijdens het laden van de pagina soepeler verloopt.','Timeout:'=>'Time-out:','Disable "lazy loading" for assets immediately visible on page load.'=>'Lazy-loading" uitschakelen voor assets die direct zichtbaar zijn bij het laden van de pagina.','Delay list:'=>'Lijst met vertragingen:',' Settings can be found on the %1$sUser Experience page%2$s.'=>' Instellingen kun je vinden op de pagina %1$sGebruikerservaring%2$s.','Specify keywords to match any attribute of script tags containing the "src" attribute. Include one entry per line, e.g. (googletagmanager.com, gtag/js, myscript.js, and name="myscript")'=>'Specificeer keywords om overeen te komen met elk attribuut van script tags die het