ot add Edge Rule "%1$s".'=>'Kon Edge rule "%1$s" niet toevoegen.','Could not add custom hostname "%1$s"'=>'Kon aangepaste hostnaam "%1$s" niet toevoegen','Controls whether web pages can be cached or not when cookies from this group are detected.'=>'Bepaalt of webpagina\'s in de cache kunnen worden opgeslagen of niet wanneer cookies uit deze groep worden gedetecteerd.','Bunny CDN API Configuration'=>'Bunny CDN API configuratie','Account API key not specified.'=>'Account API-sleutel niet opgegeven.','Account API key authorization'=>'Account API-sleutel autorisatie','Account API Key'=>'Account API-sleutel','%1$sCDN%2$s hostname:'=>'%1$sCDN%2$s hostnaam:',' (with an error)'=>' (met een fout)','Could not purge pull zone'=>'Kon de zone niet opschonen','Pull zone name:'=>'Naam pull zone:','Pull Zone Name'=>'Naam pull zone','Invalid pull zone id.'=>'Ongeldige pull zone ID.','to configure additional settings for this pull zone at Bunny.net.'=>'om aanvullende instellingen voor deze pull zone te configureren op bunny.net.','This same pull zone is used for full-site delivery.  If you delete this pull zone, then full-site delivery will be deauthorized.'=>'Deze zelfde pull zone wordt gebruikt voor full site levering.  Als je deze pull zone verwijdert, dan wordt de full site levering geautoriseerd.','The pull zone has been deleted'=>'De pull zone heeft verwijderd','Name of the pull zone (letters, numbers, and dashes).  If empty, one will be automatically generated.'=>'Naam van de pull zone (letters, cijfers en streepjes).  Als deze leeg is, wordt er automatisch een gegenereerd.','Missing pull zone id.'=>'Ontbrekend ID van de pull zone.','To obtain your account API key,'=>'Om je API-sleutel te verkrijgen,','There may be additional configuration required for full-site delivery, such as DNS changes and SSL/TLS certificate installation.'=>'Er kunnen extra configuratievereisten zijn voor levering op de volledige site, zoals DNS-wijzigingen en de installatie van SSL/TLS certificaten.','The website domain %1$sCNAME%3$s must point to the %2$sCDN%3$s hostname.'=>'Het domein van de site %1$sCNAME%3$s moet verwijzen naar de hostnaam %2$sCDN%3$s.','The full-site delivery has been deauthorized'=>'De volledige levering op de site heeft geen toestemming gekregen','Pull origin site URL or IP address.'=>'Trek de URL of het IP-adres van de origin site.','Origin URL / IP'=>'Oorsprong URL / IP','Origin %1$sURL%3$s/%2$sIP%3$s address:'=>'Oorsprong %1$sURL%3$s/%2$sIP%3$s adres:','Missing CDN hostname.'=>'Ontbrekende CDN hostnaam.','Missing account API key.'=>'Account API-sleutel ontbreekt.','log in using the main account credentials, and paste the API key into the field above.'=>'log in met de hoofdaccount inloggegevens en plak de API-sleutel in het veld hierboven.','Full-site delivery cannot be authorized if CDN for objects is already configured.'=>'Full site levering kan niet worden geautoriseerd als CDN voor objecten al is geconfigureerd.','Cannot select or add a pull zone'=>'Kan geen pull zone selecteren of toevoegen','Cannot list pull zones'=>'Kan pull zones niet vermelden','Could not purge pull zone items: '=>'Kon pull zone items niet opschonen: ','A pull zone has been configured successfully.'=>'Een pull zone is met succes geconfigureerd.','An error occurred trying to delete the pull zone; '=>'Er is een fout opgetreden bij het verwijderen van de pull zone; ','Deauthorize pull zone'=>'Pull zone de-autoriseren','Behavior'=>'Gedrag','Basic Settings'=>'Basisinstellingen','Application'=>'Applicatie','Advanced Settings'=>'Geavanceerde instellingen','Varnish Cache'=>'Varnish cache','Rest API'=>'Rest API','Empty Database Cache'=>'Databasecache legen','Empty Browser Cache'=>'Browser cache legen','Empty CDN Cache'=>'CDN-cache legen','Empty Varnish Cache'=>'Vernis cache legen','User Experience (UX) is a setting that focuses on enhancing the overall browsing experience for visitors
		of your website. By enabling this feature, you can optimize your website\'s performance by minimizing
		load times, reducing server requests, and delivering content more efficiently. This ultimately leads
		to faster page loading, improved user satisfaction, and increased engagement, resulting in a speedier
		and more enjoyable WordPress website.'=>'Gebruikerservaring (UX) is een instelling die zich richt op het verbeteren van de algehele bladeren ervaring voor bezoekers
		van je site. Door deze uitgelichte optie in te schakelen, kun je de prestaties van je site optimaliseren door laadtijden te minimaliseren,
		server aanvragen te verminderen en inhoud efficiënter te leveren. Dit leidt uiteindelijk tot
		snellere pagina lading, verbeterde gebruikerstevredenheid en verhoogde betrokkenheid, resulterend in een snellere
		en aangenamere WordPress site.','Empty Cloudflare Cache'=>'Cloudflare cache legen','Opcode cache is a powerful feature that enhances the performance of a WordPress website by caching 
			compiled PHP code. By storing pre-compiled code in memory, opcode cache eliminates the need for 
			repetitive interpretation and compilation of PHP files, resulting in significantly faster execution 
			times. Opcode cache reduces server load and improves response times, ultimately enhancing the 
			overall speed and responsiveness of your WordPress site. If opcode cache is available on the 
			hosting server it will automatically be selected in the dropdown and enabled.'=>'Opcode cache is een krachtig uitgelicht dat de prestaties van een WordPress site verbetert door
			gecompileerde PHP code te cachen. Door vooraf gecompileerde code in het geheugen op te slaan, elimineert opcode cache de noodzaak voor herhaaldelijke
			interpretatie en compilatie van PHP bestanden, resulterend in aanzienlijk snellere uitvoerings
			tijden. Opcode cache vermindert server belasting en verbetert reactietijden, uiteindelijk de
			algehele snelheid en responsiviteit van je WordPress site verbeterend. Als opcode cache beschikbaar is op de
			hosting server zal het automatisch geselecteerd worden in de dropdown en ingeschakeld.','Cache Usage Statistics is a feature that provides valuable insights into the performance of your website\'s
		caching system. It displays detailed data regarding the utilization of your cache and overall performance
		metrics. By monitoring these statistics, website owners can identify areas of improvement, optimize their
		caching settings, and ultimately enhance the speed and responsiveness of their WordPress site, resulting
		in a smoother user experience for visitors.'=>'Cache gebruiksstatistieken is een functie die waardevolle inzichten geeft in de prestaties van het caching systeem van je site
 Het toont gedetailleerde gegevens over het gebruik van je cache en de algehele prestatie
 
	 	 statistieken. Door deze statistieken te controleren, kunnen site eigenaren verbeterpunten gebieden identificeren, hun
 
	 	 caching instellingen optimaliseren en uiteindelijk de snelheid en responsiviteit van hun WordPress site verbeteren, wat
 
	 	 resulteert in een soepelere gebruikerservaring voor bezoekers.','Google PageSpeed Insights can be used to analyze your homepage and provide an explanation of metrics and recommendations for improvements using W3 Total Cache features/extensions.  This tool is enabled by default but will not function until authorization is granted, which can be done on the %1$sGeneral Settings%2$s page.'=>'Google PageSpeed insights kan worden gebruikt om je homepage te analyseren en een overzicht te geven van de statistieken en aanbevelingen voor verbeteringen met behulp van W3 Total Cache functies/extensies.  Dit gereedschap is standaard ingeschakeld, maar werkt niet totdat autorisatie is verleend, wat kan worden gedaan op de pagina %1$sAlgemene instellingen%2$s.','Image Optimization'=>'Afbeelding optimalisatie','PageSpeed Tool'=>'PageSpeed gereedschap','Minify Cache'=>'Minimaliseer cache','%1$sObject Cache%2$s is %1$sdisabled via filter%2$s'=>'%1$sObject Cache%2$s is %1$suitgeschakeld via filter%2$s','%1$sImage Optimization%2$s enabled? %1$s%3$s%2$s'=>'%1$sAfbeelding optimalisatie%2$s ingeschakeld? %1$s%3$s%2$s','Google PageSpeed Tool'=>'Google gereedschap voor paginasnelheid',' via filter'=>' via filter','This tool allows users to easily transfer their W3 Total Cache plugin settings between different WordPress installations by exporting the current configuration as a file and importing it on another site, ensuring consistent caching and performance optimizations across multiple websites.'=>'Deze tool stelt gebruikers in staat om eenvoudig hun W3 Total Cache plugin instellingen over te zetten tussen verschillende WordPress installaties door de huidige configuratie te exporteren als een bestand en deze op een andere site te importeren, waardoor consistente caching en prestatie optimalisaties worden gegarandeerd op meerdere sites.','The PageSpeed Tool is a powerful feature that can be used to help optimize and enhance the performance of your WordPress website. By leveraging the insights and recommendations provided by Google\'s PageSpeed Insights API, this tool analyzes your website\'s speed and suggests improvements to boost its performance. By implementing the recommended optimizations, such as minimizing CSS and JavaScript, optimizing images, and enabling browser caching, you can significantly accelerate your WordPress site, resulting in faster loading times and an improved user experience.'=>'De PageSpeed Tool is een krachtige functie die kan worden gebruikt om de prestaties van je WordPress site te optimaliseren en te verbeteren. Door gebruik te maken van de inzichten en aanbevelingen van de PageSpeed Insights API van Google, analyseert deze tool de snelheid van je site en geeft het suggesties ter verbetering van de prestaties. Door de aanbevolen optimalisaties toe te passen, zoals het minimaliseren van CSS en JavaScript, het optimaliseren van afbeeldingen en het inschakelen van browser caching, kun je de laadtijden van je WordPress site aanzienlijk versnellen en zorgen voor een verbeterde gebruikerservaring.','Miscellaneous settings provide additional options and configurations to optimize and speed up your WordPress website.'=>'Diverse instellingen bieden extra opties en configuraties om je WordPress site te optimaliseren en sneller te maken.','The plugin license is a key that unlocks advanced features and support for the W3 Total Cache WordPress plugin. By activating the license, users gain access to enhanced caching mechanisms, optimization tools, enabling them to significantly speed up their WordPress websites and improve overall performance.'=>'De plugin licentie is een sleutel die geavanceerde functies en ondersteuning ontgrendelt voor de W3 Total Cache WordPress plugin. Door de licentie te activeren, krijgen gebruikers toegang tot verbeterde caching mechanismen en optimalisatie gereedschappen, waardoor ze hun WordPress sites aanzienlijk kunnen versnellen en de algehele prestaties kunnen verbeteren.','A reverse proxy is a server that sits between a client and a web server, acting as an intermediary for requests. It retrieves resources on behalf of the client from the server, and then returns the response to the client. By utilizing a reverse proxy, such as Varnish or Nginx, in conjunction with W3 Total Cache, you can significantly enhance the performance of your WordPress website by caching and serving static content directly from the reverse proxy server, reducing the load on your WordPress server and improving response times for visitors.'=>'Een omgekeerde proxy is een server die zich bevindt tussen een client en een webserver en fungeert als tussenpersoon voor aanvragen. Het haalt namens de client bronnen op van de server en stuurt vervolgens de respons terug naar de client. Door gebruik te maken van een omgekeerde proxy, zoals Varnish of Nginx, in combinatie met W3 Total Cache, kun je de prestaties van je WordPress site aanzienlijk verbeteren door het cachen en serveren van statische inhoud rechtstreeks vanaf de omgekeerde proxyserver. Dit vermindert de belasting op je WordPress server en verbetert de responstijden voor bezoekers.','Object Cache is disabled via filter.'=>'Object cache is uitgeschakeld via filter.','Enable this option to utilize an object cache mechanism, which significantly enhances the performance of your WordPress website. Object caching stores frequently accessed database queries and complex data structures in memory, reducing the need to retrieve them from the database repeatedly. By doing so, it minimizes the processing time required to generate dynamic content, resulting in faster page loading times and improved overall site speed. Enabling object cache is particularly beneficial for websites with heavy database usage or high traffic volumes, as it helps alleviate the strain on the server by efficiently serving cached data.'=>'Inschakelen van deze optie om een object cache mechanisme te gebruiken, dat de prestaties van je WordPress site aanzienlijk verbetert. Object caching slaat vaak opgevraagde database query\'s en complexe datastructuren op in het geheugen, waardoor ze niet telkens opnieuw uit de database hoeven te worden opgehaald. Hierdoor wordt de verwerkingstijd die nodig is om dynamische inhoud te genereren geminimaliseerd, wat resulteert in snellere pagina laadtijden en een verbeterde algehele sitesnelheid. Het inschakelen van object cache is met name gunstig voor sites met veel databasegebruik of hoge verkeersvolumes, omdat het de belasting op de server verlicht door efficiënt gecachte gegevens te serveren.','Enabling browser caching will instruct visitors\' web browsers to store static files from your WordPress website, such as images, CSS, and JavaScript files, locally on their devices. By doing so, subsequent visits to your site will retrieve these cached files from the browser\'s storage, reducing the need for repeated downloads. This results in faster page loading times and a smoother browsing experience for your visitors, ultimately improving the overall speed and performance of your WordPress website.'=>'Het inschakelen van browser caching zal de webbrowsers van bezoekers instrueren om statische bestanden van je WordPress site, zoals afbeeldingen, CSS  en JavaScript bestanden, lokaal op hun apparaten op te slaan. Hierdoor worden deze gecachte bestanden bij volgende bezoeken aan je site opgehaald vanuit de opslag van de browser, waardoor herhaalde downloads worden verminderd. Dit resulteert in snellere pagina laadtijden en een soepelere browse ervaring voor je bezoekers, wat uiteindelijk de algehele snelheid en prestaties van je WordPress site verbetert.','Enable this setting to utilize the power of caching your WordPress site\'s database queries. By storing frequently accessed database queries in memory, the database cache reduces the need for repetitive database interactions, resulting in faster page load times. This feature is particularly beneficial for websites with heavy database usage, improving overall performance and delivering a smoother user experience.'=>'Schakel deze instelling in om gebruik te maken van de kracht van het cachen van de database queries van je WordPress site. Door veelgebruikte database queries in het geheugen op te slaan, vermindert de database cache de noodzaak voor herhaalde database interacties, wat resulteert in snellere laadtijden van pagina\'s. Deze functie is met name gunstig voor sites met intensief databasegebruik, waardoor de algehele prestaties verbeteren en een soepelere gebruikerservaring wordt geboden.','Minification is a technique used to reduce the file size of HTML, CSS, and JavaScript files by removing unnecessary characters such as whitespace, comments, and line breaks. This process can significantly improve the load times of web pages by reducing the amount of data that needs to be downloaded by the user\'s browser.'=>'Verkleining is een techniek die wordt gebruikt om de bestandsgrootte van HTML , CSS  en JavaScript bestanden te verkleinen door onnodige tekens zoals witruimte, reacties en regelafbrekingen te verwijderen. Dit proces kan de laadtijden van webpagina\'s aanzienlijk verbeteren door de hoeveelheid gegevens die door de browser van de gebruiker moet worden gedownload te verminderen.','Page cache is a technique used to speed up the performance of a website by storing a copy of the generated HTML page in the server\'s memory or disk, and then serving that copy to subsequent visitors instead of generating the page from scratch each time. This can result in significant speed improvements for websites with high traffic or dynamic content.'=>'Pagina cache is een techniek die wordt gebruikt om de prestaties van een site te versnellen door een kopie van de gegenereerde HTML pagina op te slaan in het geheugen of de schijf van de server, en vervolgens die kopie aan volgende bezoekers te serveren in plaats van de pagina telkens opnieuw te genereren. Dit kan leiden tot aanzienlijke snelheidsverbeteringen voor sites met veel verkeer of dynamische inhoud.','Learn More'=>'Leer meer','Info'=>'Info','GitHub'=>'GitHub','Documentation'=>'Documentatie','Billing Support'=>'Betalingsondersteuning','Support Center'=>'Ondersteuningscentrum','Sales Questions'=>'Vragen over de verkoop','Pro Features'=>'Pro functies','Plugin Configuration'=>'Plugin configuratie','Follow Us'=>'Volg ons','W3 Edge'=>'W3 edge','Premium Support Services'=>'Premium ondersteuningsdiensten','Plugin configuration successfully updated and all caches successfully emptied.'=>'Plugin configuratie succesvol geüpdatet en alle caches succesvol geleegd.','Performance Audit & Consultation'=>'Prestatie audit & consultatie','Learn more about Pro!'=>'Kom meer te weten over Pro!','WPML Extension'=>'WPML extensie','Investigate Compatibility Issue'=>'Compatibiliteitsprobleem onderzoeken','CDN Configuration: Full-Site Delivery'=>'CDN configuratie: levering op volledige site','Flush caches with '=>'Opschonen caches met ','Hosting Environment Troubleshooting'=>'Problemen met hostingomgevingen oplossen','Purge All Caches Except Cloudflare'=>'Alle caches opschonen behalve Cloudflare','Eliminate render-blocking JavaScript'=>'Render blokkerende JavaScript elimineren','Valid W3 Total Cache Pro license'=>'Geldige W3 total cache Pro licentie','Unlock Feature'=>'Ontgrendel uitgelicht','"New Relic" is a powerful performance monitoring and analysis tool that enhance the speed and efficiency 
			of a WordPress website. By utilizing New Relic, website owners can gain valuable insights into their 
			site\'s performance, identifying bottlenecks, slow queries, and other performance issues. With this 
			information, users can optimize their website\'s configuration, improve caching strategies, and make 
			informed decisions to deliver a faster and more responsive browsing experience for their visitors.'=>'"New Relic is een krachtig hulpmiddel voor prestatiebewaking en analyse dat de snelheid en efficiëntie 
 
	 	 	 van een WordPress site verbetert. Door gebruik te maken van New Relic kunnen site-eigenaren waardevolle inzichten krijgen in de prestaties van hun 
 
	 	 	 site en knelpunten, trage zoekopdrachten en andere prestatieproblemen identificeren. Met deze 
 
	 	 	 informatie kunnen gebruikers de configuratie van hun site optimaliseren, caching strategieën verbeteren en 
 
	 	 	 weloverwogen beslissingen nemen om hun bezoekers een snellere en meer responsive bladeren ervaring te bieden.','Fragment caching is a powerful feature that helps improve the speed and performance of your
			website. It allows you to cache specific sections or fragments of your web pages instead
			of caching the entire page. By selectively caching these fragments, such as sidebar widgets
			or dynamic content, you can reduce the processing time required to generate the page,
			resulting in faster load times and improved overall site performance.'=>'Fragment caching is een krachtige functie die helpt bij het verbeteren van de snelheid en prestaties van je site. Het stelt je in staat om specifieke secties of samenvattingen van je webpagina\'s te cachen in plaats van de hele pagina. Door deze samenvattingen selectief te cachen, zoals zijbalk widgets of dynamische inhoud, kun je de verwerkingstijd die nodig is om de pagina te genereren verminderen, wat resulteert in snellere laadtijden en verbeterde algehele prestaties van de site.','CDN Cache'=>'CDN-cache','Content Delivery Network (CDN) is a powerful feature that can significantly enhance the performance of
			your WordPress website. By leveraging a distributed network of servers located worldwide, a CDN helps
			deliver your website\'s static files, such as images, CSS, and JavaScript, to visitors more efficiently.
			This reduces the latency and improves the loading speed of your website, resulting in a faster and
			smoother browsing experience for your users. With W3 Total Cache\'s CDN integration, you can easily
			configure and connect your website to a CDN service of your choice, unleashing the full potential of
			your WordPress site\'s speed optimization.'=>'Content Delivery Network (CDN) is een krachtige functie die de prestaties van je WordPress site aanzienlijk kan verbeteren. Door gebruik te maken van een gedistribueerd netwerk van servers over de hele wereld, helpt een CDN bij het efficiënt leveren van statische bestanden van je site, zoals afbeeldingen, CSS en JavaScript, aan bezoekers. Dit vermindert de latentie en verbetert de laadsnelheid van je site, wat resulteert in een snellere en soepelere blader ervaring voor je gebruikers. Met de CDN integratie van W3 Total Cache kun je eenvoudig je site configureren en verbinden met een CDN dienst naar keuze, waardoor het volledige potentieel van de snelheidsoptimalisatie van je WordPress site wordt benut.','Cloudflare is a powerful content delivery network (CDN) and security service that can greatly enhance
			the performance and security of your WordPress website. By integrating Cloudflare with W3 Total Cache,
			you can take advantage of its global network of servers to deliver your website\'s content faster to
			visitors from around the world, resulting in reduced loading times and improved user experience.
			Additionally, Cloudflare offers various optimization features like minification, caching, and image
			optimization, further accelerating your website\'s loading speed and overall performance.'=>'Cloudflare is een krachtig Content Delivery Network (CDN) en beveiligingsservice die de veiligheid aanzienlijk kan verbeteren
			de prestaties en veiligheid van je WordPress site. Door Cloudflare te integreren met W3 Total Cache,
			je kunt profiteren van het wereldwijde netwerk van servers om de inhoud van je site sneller aan te leveren
			bezoekers van over de hele wereld, wat resulteert in kortere laadtijden en een verbeterde gebruikerservaring.
			Bovendien biedt Cloudflare verschillende optimalisatiefuncties zoals minificatie, caching en afbeeldingen
			optimalisatie, waardoor de laadsnelheid en algehele prestaties van je site verder worden versneld.','Browser Cache Content-Security-Policy-Report-Only Settings'=>'Browser cache instellingen voor Content Security Policy Report Only','The Content Security Policy - Report Only requires the "report-uri" and/or "report-to" directives. Please define one or both of these directives %1$shere%2$s.'=>'Het Content Security Policy Report Only vereist de "report-uri" en/of "report-to" directives. Gelieve één of beide van deze directieven te definiëren %1$shier%2$s.','The Content Security Policy Report Only (%1$sCSPRO%2$s) header allows web developers to experiment with policies by monitoring (but not enforcing) their effects. These violation reports consist of JSON documents sent via an HTTP POST request to the specified URI. This header is applied separately from the Content-Security-Policy and is useful for testing alternative configurations.'=>'Met de header inhoud Security Policy Report Only (%1$sCSPRO%2$s) kunnen web ontwikkelaars experimenteren met beleid door de effecten ervan te controleren (maar niet af te dwingen). Deze schending rapporten bestaan uit JSON documenten die via een HTTP BERICHT aanvraag naar de gespecificeerde URI worden verzonden. Deze header wordt los van de inhoud Security Policy toegepast en is nuttig voor het testen van alternatieve configuraties.','style-src-attr:'=>'style-src-attr:','style-src-elem:'=>'style-src-elem:','script-src-attr:'=>'script-src-attr:','script-src-elem:'=>'script-src-elem:','manifest-src:'=>'manifest-src:','child-src:'=>'sub-src:','Specifies valid sources for Worker, SharedWorker, or ServiceWorker scripts.'=>'Specificeert geldige gegevensbronnen voor Worker-, SharedWorker- of ServiceWorker scripts.','Specifies valid sources for inline styles applied to individual DOM elements.'=>'Specificeert geldige gegevensbronnen voor inline stijlen toegepast op individuele DOM elementen.','Specifies valid sources for stylesheet <style> elements and <link> elements with rel="stylesheet".'=>'Specificeert geldige gegevensbronnen voor stylesheet <style> elementen en <link> elementen met rel="stylesheet".','Specifies valid sources for JavaScript inline event handlers.'=>'Specificeert geldige gegevensbronnen voor JavaScript inline event handlers.','Specifies valid sources for JavaScript <script> elements.'=>'Specificeert geldige gegevensbronnen voor JavaScript <script> elementen.','Specifies which manifest can be applied to the resource.'=>'Specificeert welk manifest op de gegevensbron kan worden toegepast.','Defines the valid sources for web workers and nested browsing contexts loaded using elements such as <frame> and <iframe>. For workers, non-compliant requests are treated as fatal network errors by the user agent.'=>'Definieert de geldige gegevensbronnen voor web werkers en geneste bladeren contexten die worden geladen met behulp van elementen zoals <frame> en <iframe>. Voor werknemers worden niet conforme aanvragen door de user agent behandeld als fatale netwerk fouten.','Content Security Policy Report Only'=>'Alleen rapport over inhoud beveiliging beleid','worker-src:'=>'worker-src:','Defines a reporting endpoint "group" to which violation reports should to be sent.'=>'Definieert een rapportage-eindpunt "groep" waarnaar overtredingsrapporten moeten worden verzonden.','report-uri:'=>'report-uri:','report-to:'=>'report-to:','Instructs the user agent to report attempts to violate the Content Security Policy. These violation reports consist of JSON documents sent via an HTTP POST request to the specified URI.'=>'Instrueert de user agent om pogingen tot schending van het inhoud beveiliging beleid te rapporteren. Deze schending rapporten bestaan uit JSON documenten die via een HTTP BERICHT aanvraag naar de gespecificeerde URI worden verzonden.','The referenced "group" should be defined in either the Report-To or Reporting-Endpoints HTTP headers. These will need to be manually defined either via .htaccess or another method of modifying HTTP headers.'=>'De "groep" waarnaar wordt verwezen moet worden gedefinieerd in de Report-To of Reporting-Endpoints HTTP headers. Deze moeten handmatig worden gedefinieerd via .htaccess of een andere methode om HTTP headers te wijzigen.','Value'=>'Waarde','Group'=>'Groep','Type'=>'Type','Desktop'=>'Desktop','Passed Audits'=>'Geslaagde controles','Diagnostics'=>'Diagnostiek','Opportunities'=>'Mogelijkheden','Tips'=>'Tips','No identified items were provided by Google PageSpeed Insights API for this metric'=>'Er zijn geen geïdentificeerde items geleverd door de Google PageSpeed insights API voor deze statistiek','Element'=>'Element','Statistic'=>'Statistiek','Cache Hit Probability'=>'Cache hit waarschijnlijkheid','Cache Lifetime Miliseconds'=>'Cache levensduur milliseconden','Total'=>'Totaal','Execution Time'=>'Executie tijd','Parse/Compile Time'=>'Parse/compile tijd','Duration'=>'Duur','Start Time'=>'Start tijd','Transfer Size'=>'Overdracht grootte','Wasted Miliseconds'=>'Verspilde milliseconden','Wasted Percentage'=>'Verspild percentage','Wasted Bytes'=>'Verspilde bytes','Total Bytes'=>'Totaal aantal bytes','Copy Full URL'=>'Volledige URL kopiëren','Other Screenshot'=>'Andere schermafbeelding','Desktop: '=>'Desktop: ','Mobile: '=>'Mobiel: ','View All Results'=>'Bekijk alle resultaten','CLS'=>'CLS','LCP'=>'LCP','Cumulative Layout Shift'=>'Cumulatieve lay-out verschuiving','TBT'=>'TBT','FCP'=>'FCP','ALL'=>'ALLE','90–100'=>'90–100','50–89'=>'50–89','0–49'=>'0–49','Total Blocking Time'=>'Totale blokkeertijd','First Contentful Paint'=>'First Contentful Paint','Largest Contentful Paint'=>'Grootste Contentful Paint','Audit Results'=>'Audit resultaten','Final Screenshot'=>'Laatste schermafbeelding','Core Metrics'=>'Core statistieken','%1$sValues are estimated and may vary. The %2$sperformance score is calculated%3$s directly from these metrics. %4$sSee calculator.%5$s%6$s'=>'%1$sWaarden worden geschat en kunnen variëren. De %2$sperformance score wordt berekend%3$s rechtstreeks uit deze statistieken. %4$sZie rekenmachine.%5$s%6$s','Mobile'=>'Mobiel','Analysis last run '=>'Analyse laatste uitvoering ','Desktop response Message : '=>'Desktop reactie bericht : ','Desktop response Code : '=>'Desktop reactie code : ','Mobile response Message : '=>'Mobiel reactie bericht : ','Mobile response Code : '=>'Mobiele reactie code : ','Analyze URL : '=>'URL analyseren: ','API request failed!'=>'API aanvraag mislukt!','Screenshots'=>'Schermafbeeldingen','An error has occured!'=>'Er is een fout opgetreden!','Running Analysis. This may take up to 2 minutes.'=>'Analyse uitvoeren. Dit kan tot 2 minuten duren.','Pageload Thumbnails'=>'Thumbnails voor het laden van pagina\'s','Before you can get started using the Google PageSpeed tool, you’ll first need to authorize access. Please click %1$s.'=>'Voordat je aan de slag kan met het Google PageSpeed gereedschap, moet je eerst toegang autoriseren. Klik op %1$s.','This tool will analyze your website\'s homepage using the Google PageSpeed Insights API to gather desktop/mobile performance metrics. Additionally for each metric W3 Total Cache will include an explanation of the metric and our recommendation for achieving improvements via W3 Total Cache features/extensions if available. Results will be cached for %1$s but will forcibly refresh via the "Refresh Analysis" button.'=>'Dit gereedschap zal de homepage van je site analyseren met behulp van de Google PageSpeed Insights API om desktop/mobiele prestatiegegevens te verzamelen. Voor elke metriek zal W3 Total Cache een uitleg van de metriek toevoegen en onze aanbeveling voor het verbeteren van de prestaties via W3 Total Cache functies/extensies, indien beschikbaar. Resultaten worden gecachet voor %1$s, maar kunnen worden vernieuwd via de knop "Analyse vernieuwen".','An unknown error occured attempting to filter audit results!'=>'Er is een onbekende fout opgetreden bij het filteren van audit resultaten!','Error : '=>'Fout: ','Reduce your JavaScript payload by implementing code splitting, minifying and compressing your JavaScript code, removing unused code, and following the PRPL pattern. (Use %1$s %2$sMinify for JS%3$s and compression.) Use %4$sCDN%5$s and HTTP2 Push if available on server.'=>'Verminder je JavaScript belasting door code te splitsen, je JavaScript code te verkleinen en te comprimeren, ongebruikte code te verwijderen en het PRPL patroon te volgen. (Gebruik %1$s %2$s verklein voor JS%3$s en compressie.) gebruik %4$sCDN%5$s en HTTP2 Push indien beschikbaar op de server.','Reduce the time spent parsing CSS by minifying, or deferring non-critical CSS, or removing unused CSS. (Use %1$s %2$sMinify for CSS%3$s and compression.) Use %4$sCDN%5$s and HTTP2 Push if available on server.'=>'Verminder de tijd die wordt besteed aan het parsen van CSS door niet kritieke CSS te verkleinen, of uit te stellen, of ongebruikte CSS te verwijderen. (Gebruik %1$s %2$s verklein voor CSS%3$s en compressie.) gebruik %4$sCDN%5$s en HTTP2 Push indien beschikbaar op de server.','Minimize critical JavaScript.'=>'Minimaliseer kritieke JavaScript.','If the cause is resource load times:'=>'Als de oorzaak de laadtijden van gegevensbronnen zijn:','Inline critical CSS.'=>'Inline kritieke CSS.','	element.'=>'	element.','Stick to using compositor properties to keep events away from the main-thread. Compositor properties are run on a separate compositor thread, freeing the main-thread for longer and improving your page load performance.'=>'Blijf bij het gebruik van compositor eigenschappen om gebeurtenissen uit de buurt van de hoofd thread te houden. Compositor eigenschappen worden uitgevoerd op een afzonderlijke compositor thread, waardoor de hoofd thread langer vrijkomt en de laadprestaties van je pagina\'s worden verbeterd.','Add a passive flag to every event listener that Lighthouse identified.'=>'Voeg een passive vlag toe aan elke gebeurtenis listener die Lighthouse heeft geïdentificeerd.','If you\'re only supporting browsers that have passive event listener support, just add the flag.'=>'Als je alleen browsers ondersteunt die passive ondersteuning voor gebeurtenis listeners hebben, voeg je gewoon de vlag toe.','Minimize unused polyfills.'=>'Minimaliseer ongebruikte polyfills.','Minify CSS.'=>'Verklein CSS.','If the cause is render-blocking JavaScript and CSS:'=>'Als de oorzaak render blok JavaScript en CSS is:','Establish third-party connections early.'=>'Breng vroegtijdig verbindingen met derden tot stand.','Cache assets.'=>'Cache assets.','Route users to a nearby CDN.'=>'Leid gebruikers naar een CDN in de buurt.','Optimize your server.'=>'Optimaliseer je server.','If the cause is slow server response time:'=>'Als de oorzaak een trage reactie tijd van de server is:','How To Fix Poor LCP'=>'Hoe slechte LCP te repareren','Use default values for best results'=>'Standaard waarden gebruiken voor de beste resultaten','Review your website\'s third-party code and remove the ones that aren\'t adding any value to your website.'=>'Beoordeel de code van je site en verwijder degene die geen waarde toevoegen aan je site.','Use another rendering strategy.'=>'Gebruik een andere rendering strategie.','If the cause is client-side rendering:'=>'Als de oorzaak client side rendering is:','Deliver different assets based on the network connection (adaptive serving).'=>'Lever verschillende assets op basis van de netwerk verbinding (adaptieve bediening).','Compress text files.'=>'Comprimeer tekst bestanden.','Preload important resources.'=>'Laad belangrijke gegevensbronnen vooraf.','Optimize and compress images.'=>'Optimaliseer en comprimeer afbeeldingen.','Defer unused JavaScript.'=>'Stel ongebruikt JavaScript uit.','Minify and compress JavaScript files.'=>'Verklein en comprimeer JavaScript bestanden.','Defer non-critical CSS.'=>'Stel niet kritieke CSS uit.','Only using compositor properties:'=>'Alleen compositor eigenschappen gebruiken:','For example:'=>'Bijvoorbeeld:','Don\'t lazy load images that appear "above the fold" just use a standard '=>'Lazy-load geen afbeeldingen die "boven de vouw" verschijnen, gebruik gewoon een standaard ','Use A Lightweight Social Sharing Plugin'=>'Gebruik een lichtgewicht plugin voor sociaal delen','Replace Embeds With Screenshots'=>'Insluiten vervangen door schermafbeeldingen','Using %1$s JS Minify and deferring or using async may also help.'=>'Het gebruik van %1$s JS Minify en het uitstellen of gebruiken van async kan ook helpen.','Host Google Fonts Locally'=>'Host Google Fonts lokaal','Lazy Load YouTube Videos'=>'Lazy-load YouTube video\'s','Find Slow Third-Party-Code'=>'Trage code van derden zoeken','Use Cloudflare Workers'=>'Gebruik Cloudflare workers','Cache assets using a service worker.'=>'Cache assets met behulp van een service worker.','More details %1$s.'=>'Meer details %1$s.','Preload fonts with a plugin or manually:'=>'Lettertypen vooraf laden met een plugin of handmatig:','It\'s advisable to host the fonts on the server instead of using Google CDN'=>'Het is raadzaam om de lettertypen op de server te hosten in plaats van Google CDN te gebruiken','Use the "viewport" <meta> tag to control the viewport\'s size and shape form mobile friendly website:'=>'Gebruik de tag "viewport" <meta> om de grootte en vorm van de viewport te bepalen vanaf een mobiel vriendelijke site:','Exclude the image from being lazy-loaded if the %1$s Lazy load is enabled in Performance &raquo; User Experience &raquo; Exclude words.'=>'Sluit uit dat de afbeelding lazy-loaded als de %1$s lazy-load is ingeschakeld in prestaties » gebruikers ervaring » woorden uitsluiten.','You can fix this audit by preferably eliminating document.write() altogether, wherever possible.'=>'Je kunt deze audit oplossen door document.write() bij voorkeur helemaal te elimineren, waar mogelijk.','Where width and height have been declared as 640 and 360 pixels respectively.'=>'Waarbij breedte en hoogte zijn aangegeven als respectievelijk 640 en 360 pixels.','Avoid Google AdSense And Maps'=>'Vermijd Google AdSense en Maps','Prefetch Or Preconnect Third-Party Scripts'=>'Prefetch of preconnect scripts van derden','Delay Third-Party JavaScript'=>'JavaScript van derden vertragen','Host Gravatars Locally'=>'Host Gravatars lokaal','Use %1$sBrowser Caching%2$s in %3$s and set the Expires header and cache control header for static files and HTML.'=>'Gebruik %1$sbrowser caching%2$s in %3$s en stel de verloop header en cache controle header in voor statische bestanden en HTML.','Host Facebook Pixel Locally'=>'Facebook pixel lokaal hosten','Host Google Analytics Locally'=>'Google Analytics lokaal hosten','Defer Parsing Of JavaScript'=>'Het parsen van JavaScript uitstellen','Don\'t Overtrack In Google Tag Manager'=>'Niet overdrijven in Google Tag Manager','Note that modern browsers automatically calculate the aspect ratio for an image/video based on the declared width and height attributes.'=>'Merk op dat moderne browsers automatisch de afbeelding verhouding voor een afbeelding/video berekenen op basis van de opgegeven breedte en hoogte attributen.','To fix this audit, simply specify, both, the width and height for your webpage\'s image and video elements. This ensures that the correct spacing is used for images and videos.'=>'Om deze controle te verhelpen, geef je gewoon zowel de breedte als de hoogte op voor de afbeelding en de video van je webpagina. Dit zorgt ervoor dat de juiste spatiëring wordt gebruikt voor afbeeldingen en video\'s.','Avoiding the use of document.write() should ideally be built into your development workflow so that your production website is optimized for web performance from the beginning.'=>'Het vermijden van het gebruik van document.write() zou idealiter moeten worden ingebouwd in je ontwikkeling workflow, zodat je productie site vanaf het begin is geoptimaliseerd voor web prestaties.','If you\'re supporting older browsers that don\'t support passive event listeners, you\'ll need to use feature detection or a polyfill. See the Feature Detection section of the WICG Passive event listeners explainer document for more information.'=>'Als je oudere browsers ondersteunt die geen passieve event listeners ondersteunen, moet je functie detection of een polyfill gebruiken. Zie de sectie functie detection van het WICG passive event listeners uitlegdocument voor meer informatie.','Serve HTML pages cache-first.'=>'Serveer HTML pagina\'s cache eerst.','Use font-display attribute: The font-display attribute determines how the font is displayed during your page load, based on whether it has been downloaded and is ready for use.'=>'Gebruik het font-display attribuut: het font-display attribuut bepaalt hoe het lettertype wordt weergegeven tijdens het laden van je pagina, gebaseerd op de vraag of het is gedownload en klaar is voor gebruik.','Preload - Lazyload embedded videos.'=>'Vooraf laden - Lazy-load ingesloten video\'s.','Features that will help performance of the above:'=>'Functies die zullen helpen bij het uitvoeren van het bovenstaande:','Eliminate Render Blocking CSS and apply asynchronous loading where applicable. Additionally, image optimization by way of resizing, lazy loading, and WebP conversion can impact this metric as well.'=>'Elimineer render blokkerende CSS en pas asynchrone laden toe waar van toepassing. Bovendien kan afbeelding optimalisatie door middel van formaat aanpassing, lazy-loading en WebP conversie ook van invloed zijn op deze statistiek.','Review your website\'s third-party code and remove the ones	that aren\'t adding any value to your website.'=>'Beoordeel de code van je site en verwijder degene die geen waarde toevoegen aan je site.','Only using compositor properties'=>'Alleen compositor eigenschappen gebruiken','Reducing JavaScript execution time'=>'De uitvoeringstijd van JavaScript verkorten','Optimizing third-party JavaScript'=>'JavaScript van derden optimaliseren','Chrome DevTools Timeline Recordings'=>'Chrome DevTools Timeline Recordings','You can access those data from JavaScript using the API or by viewing them on your %1$s.'=>'Je kunt toegang krijgen tot die gegevens vanuit JavaScript met behulp van de API of door ze te bekijken op je %1$s.','Delay 3rd-party JS'=>'Vertraging derde partij JS','Reducing CSS parsing time'=>'CSS parse tijd verkorten','User Timing API'=>'Gebruiker timing API','Using a different slider'=>'Een andere slider gebruiken','Using a different theme'=>'Een ander thema gebruiken','The %1$s gives you a way to measure your app\'s JavaScript performance.'=>'De %1$s geeft je een manier om de JavaScript prestaties van je app te meten.','You do that by inserting API calls in your JavaScript and then extracting detailed timing data that you can use to optimize your code.'=>'Dat doe je door API aanroepen in je JavaScript in te voegen en vervolgens gedetailleerde timing gegevens te extraheren die je kan gebruiken om je code te optimaliseren.','Using a simpler web page builder as many page builders add a lot of code bloat'=>'Een eenvoudigere web pagina bouwer gebruiken, omdat veel pagina bouwers veel code bloat toevoegen','Reducing the amount of widgets / sections within your web pages or page layouts'=>'Het verminderen van het aantal widgets/secties binnen je web pagina\'s of pagina lay-outs','Debouncing your input handlers'=>'Debouncing je input handlers','Debouncing your input handlers helps solve both of the above problems.'=>'Het debouncen van je input handlers helpt bij het oplossen van beide bovenstaande problemen.','Without completely redesigning your web page from scratch, typically you cannot resolve this warning. Understand that this warning is significant and if you get it for more than one or two pages in your site, you should consider:'=>'Zonder je webpagina helemaal opnieuw te ontwerpen, kun je deze waarschuwing meestal niet oplossen. Begrijp dat deze waarschuwing belangrijk is en dat als je hem voor meer dan één of twee pagina\'s van je site krijgt, je moet overwegen:','Avoid using long-running input handlers (which may block scrolling) and do not make style changes in input handlers (which is likely to cause repainting of pixels).'=>'Vermijd het gebruik van lang lopende invoer handlers (die het scrollen kunnen blokkeren) en maak geen stijl wijzigingen in invoer handlers (die waarschijnlijk leiden tot het opnieuw weergeven van pixels).','Reduce your JavaScript payload by implementing code splitting, minifying and compressing your JavaScript code, removing unused code, and following the PRPL pattern. (Use %1$s Minify for %2$sJS%3$s and compression.) Use %4$sCDN%5$s and HTTP2 Push if available on server.'=>'Verminder je JavaScript belasting door code te splitsen, je JavaScript code te verkleinen en te comprimeren, ongebruikte code te verwijderen en het PRPL patroon te volgen. (Gebruik %1$s verklein voor %2$sJS%3$s en compressie.) gebruik %4$sCDN%5$s en HTTP2 Push indien beschikbaar op de server.','Reduce the time spent parsing CSS by minifying, or deferring non-critical CSS, or removing unused CSS. (Use %1$s Minify for %2$sCSS%3$s and compression.) Use %4$sCDN%5$s and HTTP2 Push if available on server.'=>'Verminder de tijd die wordt besteed aan het parsen van CSS door niet kritieke CSS te verkleinen, of uit te stellen, of ongebruikte CSS te verwijderen. (Gebruik %1$s verklein voor %2$sCSS%3$s en compressie.) gebruik %4$sCDN%5$s en HTTP2 Push indien beschikbaar op de server.','Learn more about implementing this technique %1$s.'=>'Meer informatie over het implementeren van deze techniek %1$s.','For browsers that don\'t support '=>'Voor browsers die geen ondersteuning bieden ',' you can use the translated ES5 code instead. In this manner, you are always serving modern code to modern browsers.'=>' Je kunt in plaats daarvan de vertaalde ES5 code gebruiken. Op deze manier leveren je altijd moderne code aan moderne browsers.','Use %1$s %2$sPage Caching%3$s (fastest module)'=>'Gebruik %1$s %2$sPage caching%3$s (snelste module)','Where "https://third-party-example.com"	is the domain of the respective third-party resource.'=>'Waarbij "https://third-party-example.com" het domein is van de betreffende externe gegevensbron.','Always redirect to the preferred version of the URL, especially, when redirects are dynamically generated. This helps eliminate unnecessary redirects.'=>'Verwijs altijd door naar de gewenste versie van de URL, vooral wanneer omleidingen dynamisch worden gegenereerd. Dit helpt onnodige omleidingen te elimineren.','Wherever possible, avoid landing page redirects; especially, the practice of executing separate, individual redirects for reasons such as protocol change, adding www, mobile-specific page, geo-location, and subdomain.'=>'Vermijd waar mogelijk omleidingen op landing pagina\'s; met name de praktijk van het uitvoeren van afzonderlijke, individuele omleidingen om redenen zoals protocol wijziging, het toevoegen van www, mobiel specifieke pagina, geolocatie en subdomein.','Avoid client-side redirects, as much as possible, as they are slower, non-cacheable and may not be supported by browsers by default.'=>'Vermijd omleidingen aan de client zijde zoveel mogelijk, omdat deze langzamer zijn, niet in de cache kunnen worden opgeslagen en mogelijk niet standaard door browsers worden ondersteund.','When dealing with server-side redirects, we recommend that they be executed via web server configuration as they are often faster than application-level configuration.'=>'Wanneer we te maken hebben met server zijde omleidingen, raden we aan om ze uit te voeren via web server configuratie, omdat ze vaak sneller zijn dan configuratie op applicatie niveau.','Every browser that supports '=>'Elke browser die ondersteunt ','webpack-stats-duplicates'=>'webpack statistieken duplicaten','Similarly, remove temporary redirects if not needed anymore.'=>'Verwijder ook tijdelijke omleidingen als dat niet meer nodig is.','Implement modern feature-detection using '=>'Implementeer moderne functie detectie met behulp van ',' also supports most of the ES6 features. This lets you load regular JavaScript files with ES6 features, knowing that the browser can handle it.'=>' Ondersteunt ook de meeste ES6 functies. Hiermee kun je reguliere JavaScript bestanden laden met ES6 functies, wetende dat de browser dit aankan.','To fix this audit, use a tool like %1$s to identify duplicate modules'=>'Om deze audit op te lossen, gebruik je een gereedschap zoals %1$s om dubbele modules te identificeren','Where "https://third-party-example.com" is the critical third-party domain your page intends to connect to.'=>'Waarbij "https://third-party-example.com" het kritieke domein van derden is waarmee je pagina verbinding wil maken.','One way to deal with this issue is to load polyfills, only when needed, which can provide feature-detection support at JavaScript runtime. However, it is often very difficult to implement in practice.'=>'Een manier om dit probleem aan te pakken is het laden van polyfills, alleen wanneer nodig, die ondersteuning kunnen bieden voor het detecteren van functies tijdens het uitvoeren van JavaScript. Dit is in de praktijk echter vaak erg moeilijk te implementeren.','Incorporate good site building practices into your development workflow to ensure you avoid duplication of JavaScript modules in the first place.'=>'Neem goede methoden voor het bouwen van sites op in je ontwikkeling workflow om ervoor te zorgen dat je dubbele JavaScript modules voorkomt.','Remember that combining multiple redirects into a single redirect is the most effective way to improve web performance.'=>'Vergeet niet dat het combineren van meerdere omleidingen in een enkele omleiding de effectiefste manier is om de web prestaties te verbeteren.','Add dns-prefetch for all other third-party domains. For all other third-party scripts, including non-critical ones, add the following code to the link tag:'=>'Voeg dns prefetch toe voor alle andere domeinen van derden. Voeg voor alle andere scripts van derden, ook de niet kritieke, de volgende code toe aan de link tag:','Add preconnect for critical third-party domains. Out of the list of third-party resources flagged by Google Page speed, identify the critical third-party resources and add the following code to the link tag:'=>'Preconnect toevoegen voor kritieke domeinen van derden. Uit de lijst met gegevensbronnen van derden die door Google Page speed zijn gemarkeerd, identificeer je de kritieke gegevensbronnen van derden en voeg je de volgende code toe aan de link tag:','Defer or async the JS (Select  Non blocking using Defer or  Non blocking using async Embed method in %1$s %2$sMinify%3$s options before head and after body)'=>'Defer of async de JS (Selecteer niet blokkeren met defer of niet blokkeren met async insluiten methode in %1$s %2$sVerkleinen%3$s opties voor head en na body)','Compress your HTML, CSS, and JavaScript files and Minify your CSS and JavaScript to ensure your text-based resources are as small as they can be. Use the %1$s Minify %2$sJS%3$s and %4$sCSS%5$s features to accomplish this.'=>'Comprimeer je HTML-, CSS  en JavaScript bestanden en verklein je CSS  en JavaScript bestanden om ervoor te zorgen dat je tekstgebaseerde bronnen zo klein mogelijk zijn. Gebruik de %1$s verklein %2$sJS%3$s en %4$sCSS%5$s functies om dit te bereiken.','Use %1$sBrowser Caching%2$s for static files and HTML  - 1 year for static files 1 hour for html'=>'Gebruik %1$sbrowser caching%2$s voor statische bestanden en HTML  - 1 jaar voor statische bestanden 1 uur voor HTML','Optimize your image delivery by sizing them properly and compressing them for smaller sizes. Use WebP conversion via the %1$s %2$sWebP Converter%3$s extension.'=>'Optimaliseer de levering van je afbeeldingen door ze op de juiste grootte te maken en te comprimeren voor kleinere formaten. Gebruik WebP conversie via de %1$s %2$sWebP Converter%3$s extensie.','Brotli extension'=>'Brotli extensie','W3TC Extensions'=>'W3TC extensies','Enable lazy load for images.'=>'Schakel lazy-load in voor afbeeldingen.','Use image optimization plugin.'=>'Gebruik de plugin voor afbeelding optimalisatie.','A single image'=>'Een enkele afbeelding','Using srcset:'=>'Met behulp van srcset:','With this breakdown, we can see how many unused bytes are in our JS files, so we can manually remove them.'=>'Met deze uitsplitsing kunnen we zien hoeveel ongebruikte bytes er in onze JS bestanden zitten, zodat we ze handmatig kunnen verwijderen.','photoshop'=>'PhotoShop','For example, let\'s say you want to send a high-resolution image to only those users that have high-resolution screens, as	determined by the Device pixel ratio (DPR). The code would look like this:'=>'Stel bijvoorbeeld dat je een afbeelding met een hoge resolutie wil verzenden naar alleen die gebruikers die een scherm met een hoge resolutie hebben, zoals bepaald door de apparaat pixel ratio (DPR). De code zou er als volgt uitzien:','Look at the list of third-party resources flagged by Google Page speed and add preconnect or dns-prefetch to their link tags depending on whether the resource is critical or not.'=>'Bekijk de lijst met gegevensbronnen van derden die door Google Page speed zijn gemarkeerd en voeg preconnect of dns prefetch toe aan hun link tags, afhankelijk van of de gegevensbron kritiek is of niet.','Essentially, you create various sizes of your image, and then utilize the srcset tag to define when the images get served. This is useful for responsive design when you have multiple images to deliver across	several devices and dimensions.'=>'In wezen maak je verschillende formaten van je afbeelding, en gebruik je de srcset tag om te bepalen wanneer de afbeeldingen worden geserveerd. Dit is handig voor responsive ontwerp als je meerdere afbeeldingsformaten moet leveren op verschillende apparaten en afmetingen.','The srcset HTML tag provides the browser with variations of an image (including a fallback image) and instructs the browser to use specific images depending on the situation.'=>'De srcset HTML tag voorziet de browser van variaties van een afbeelding (inclusief een fallback afbeelding) en instrueert de browser om specifieke afbeeldingen te gebruiken, afhankelijk van de situatie.','Use %1$s %2$sWebP Converter%3$s to convert media library images to WebP.'=>'Gebruik %1$s %2$sWebP Converter%3$s om afbeeldingen in de mediabibliotheek naar WebP te converteren.','Use %1$s Browser Caching - Performance>Browser Cache - Enable Gzip compression or Brotli compression (Gzip compression is most common and for Brotli compression you need to install %2$s on your server.'=>'Gebruik %1$s Browser caching - Prestatie>Browser cache - Schakel Gzip compressie of Brotli compressie in (Gzip compressie is het meest gebruikt en voor Brotli compressie moet je %2$s installeren op je server.','Some themes and plugins are loading JS files or parts of the JS files on all pages and not only on the pages that should be loading on. For example if you are using some contact form plugin, there is a chance that the JS file of that plugin will load not only on the /contact/ page, but on all other pages as well and this is why the unused JS should be removed.'=>'Sommige thema\'s en plugins laden JS bestanden of delen van JS bestanden op alle pagina\'s en niet alleen op de pagina\'s waar dat zou moeten. Als je bijvoorbeeld een contact formulier plugin gebruikt, is er een kans dat het JS bestand van die plugin niet alleen op de /contact/ pagina wordt geladen, maar ook op alle andere pagina\'s. Daarom moet de ongebruikte JS worden verwijderd.','It\'s important to prepare images before uploading them to the website. This should be done before the Image is uploaded and can be done by using some image optimization tool like %1$s.'=>'Het is belangrijk om afbeeldingen voor te bereiden voordat ze naar de site te uploaden. Dit moet worden gedaan voordat de afbeelding wordt geüpload en kan worden gedaan met behulp van een afbeelding optimalisatie gereedschap zoals %1$s.','On the %1$s tab all of the recommended settings are preset. Use the help button to simplify discovery of your %2$s and %3$s files and groups. Pay close attention to the method and location of your %3$s group embeddings. See the plugin\'s %4$s for more information on usage.'=>'Op de tab %1$s staan alle aanbevolen instellingen ingesteld. Gebruik de helpknop om het ontdekken van je %2$s en %3$s bestanden en groepen te vereenvoudigen. Let goed op de methode en locatie van je %3$s groep insluitingen. Zie de plugin\'s %4$s voor meer informatie over het gebruik.','If you have a webpage you want to analyze its code coverage. Load the webpage and click on the o button in the Coverage tab.'=>'Als je een webpagina hebt, wil je de code dekking analyseren. Laad de webpagina en klik op de o knop op de tab Dekking.','Open your Chrome browser, go to “Developer Tools”, click on “More Tools” and then “Coverage”.'=>'Open je Chrome browser, ga naar "Developer gereedschappen", klik op "Meer gereedschappen" en vervolgens op "Dekking".','Coverage will open up. We will see buttons for start capturing coverage, to reload and start capturing coverage and to stop capturing coverage and show results.'=>'Coverage wordt geopend. We zullen knoppen zien voor het starten van de registratie, voor het herladen en starten van de registratie en voor het stoppen van de registratie en het tonen van de resultaten.','With this breakdown, we can see how many unused bytes are in our CSS files, so we can manually remove them.'=>'Met deze uitsplitsing kunnen we zien hoeveel ongebruikte bytes er in onze CSS bestanden staan, zodat we ze handmatig kunnen verwijderen.','After sometime, a table will show up in the tab with the resources it analyzed, and how much code is used in the webpage. All the files linked in the webpage (css, js) will be listed in the Coverage tab. Clicking on any resource there will open that resource in the Sources panel with a breakdown of Total Bytes and Unused Bytes.'=>'Na enige tijd verschijnt in de tab een tabel met 