							However, if you\'re having errors try the "combine only" option and if that still generates
							errors, there are bugs in the code of your theme or plugins or both that prevent minification
							of %5$sJS%6$s from working automatically.'=>'Zodra %1$sCSS%2$s is geoptimaliseerd, probeer je %3$sJS%4$s verkleining. Als de automatische modus niet werkt voor↵
→ → → → → → → je zorgt ervoor dat je de fout console van de webbrowser controleert om snel te bevestigen dat de optimalisatie↵
→ → → → → → → werkt niet. Als JavaScript werkt, kun je aanvullende optimalisaties maken voor↵
→ → → → → → → gebruikers ervaring zoals experimenteren met insluit locaties enz. of het verder verkleinen van de bestandsgrootte enz.↵
→ → → → → → → Als je echter fouten ondervindt, probeer dan de optie "Alleen combineren" en als dat nog steeds ↵
→ → → → → → → fouten genereert, er zitten bugs in de code van je thema of plugins of beide die minificatie voorkomen↵
→ → → → → → → van %5$sJS%6$s automatisch werkt.','Still want to get started? Now for the Pro\' tips:'=>'Wil je nog aan de slag? Nu voor de Pro\' tips:','The interactions and dependencies of %1$sCSS%2$s or %3$sJS%4$s on each other can be complex.
							Themes and plugins are typically created by various developers and can be combined in
							millions of combinations. As a result, W3 Total Cache cannot take all of those nuances into
							account, it just does the operation and let\'s you tune to what degree it does it, it
							doesn\'t "validate" the result or know if it\'s good or bad; a human must do that.'=>'De interacties en afhankelijkheden van %1$sCSS%2$s of %3$sJS%4$s op elkaar kunnen complex zijn.↵
→ → → → → → → Thema\'s en plugins worden meestal gemaakt door verschillende ontwikkelaars en kunnen worden gecombineerd in↵
→ → → → → → → miljoenen combinaties. Als gevolg hiervan kan W3 Total Cache niet al deze nuances verwerken↵
→ → → → → → → account, het doet gewoon de bewerking en laat je afstemmen in welke mate het het doet, het↵
→ → → → → → → valideert het resultaat niet en weet niet of het goed of slecht is; een mens moet dat doen.','Start with minify for your %1$sCSS%2$s using auto mode first. If you have any issues at that step,
