→ → → → → → → neem contact op met je ontwikkelaar(s) en rapporteer een bug. Ze zouden je in de juiste richting kunnen wijzen↵
→ → → → → → → het probleem oplossen of oplossen in een toekomstige update.','%1$sUpgrade Performance%2$s'=>'%1$sPrestaties upgraden%2$s','an "instant on" or "set it and forget it" optimization technique.'=>'een "instant on" of "set it and forget it" optimalisatietechniek.','Create a list of redirects to %1$sCDN%2$s (hostname specified in hostname field #1.)'=>'Maak een lijst met omleidingen naar %1$sCDN%2$s (hostnaam opgegeven in hostnaamveld #1.)','Hang on!'=>'Wacht even!','What is minification exactly?'=>'Wat is minificatie precies?','Minification is a process of reducing the file size to improve user experience and it requires
					testing in order to get it right &mdash; as such it doesn\'t work for everyone.'=>'Verkleining is een proces waarbij de bestandsgrootte wordt verkleind om de gebruikerservaring te verbeteren en het vereist
