 %1$sSASL%2$s verificatie wordt gebruikt','Secure Socket Layer'=>'Secure Socket Layer','Verify TLS Certificates:'=>'Controleer TLS certificaten:','Verify the server\'s certificate when connecting via TLS.'=>'Controleer het servercertificaat wanneer je verbinding maakt via TLS.','Always cache %1$sURL%2$ss that use these query string name-value pairs. The value part is not required. But if used, separate name-value pairs with an equals sign (i.e., name=value). Each pair should be on their own line.'=>'Cache altijd %1$sURL%2$ss die deze naam-waardeparen van query string gebruiken. Het waardedeel is niet vereist. Maar indien gebruikt, afzonderlijke naam waarde paren met een gelijkteken (d.w.z. naam = waarde). Elk paar moet op zijn eigen lijn staan.','Additional home %1$sURL%2$ss:'=>'Extra home %1$sURL%2$ss:','Cache %1$sSSL%2$s requests (uniquely) for improved performance.'=>'Cache %1$sSSL%2$s aanvragen (uniek) voor betere prestaties.','Significantly reduce the default %1$sTTL%2$s for comment cookies to reduce the number of authenticated user traffic. Enter -1 to revert to default %3$sTTL%4$s.'=>'Verlaag de standaard %1$sTTL%2$s voor reactie cookies aanzienlijk om het aantal geauthenticeerde gebruikersverkeer te verminderen. Voer -1 in om terug te keren naar de standaard %3$sTTL%4$s.','If disabled, HEAD requests can often be cached resulting in "empty pages" being returned for subsequent requests for a %1$sURL%2$s.'=>'Indien uitgeschakeld, kunnen HEAD aanvragen vaak in de cache worden opgeslagen, waardoor bij volgende aanvragen om een %1$sURL%2$s"lege pagina\'s" worden geretourneerd.','Specify full home %1$sURL%2$ss of your mirrors so that plugin will flush it\'s cache when content is changed. For example:%3$s http://my-site.com%4$shttp://www.my-site.com%5$shttps://my-site.com'=>'Specificeer volledige home %1$sURL%2$ss van je mirrors zodat de plugin zijn cache leegt wanneer de inhoud wordt gewijzigd. Bijvoorbeeld:%3$s http://my-site.com%4$shttp://www.my-site.com%5$shttps://my-site.com','%1$sCSS%2$s file management:'=>'%1$sCSS%2$s bestandsbeheer:','%1$sCSS%2$s minify settings:'=>'%1$sCSS%2$s instellingen verkleinen:','%1$sHTML%2$s minify settings:'=>'%1$sHTML%2$s instellingen verkleinen:','%1$sJS%2$s file management:'=>'%1$sJS%2$s bestandsbeheer:','%1$sJS%2$s minify settings:'=>'%1$sJS%2$s instellingen verkleinen:','Additional installation guides can be found in the %1$swiki%2$s.'=>'Aanvullende installatiehandleidingen zijn te vinden in de %1$swiki%2$s.','Before %1$s&lt;/head&gt;%2$s'=>'Voor %1$s&lt;/head&gt;%2$s','No %1$sCSS%2$s files added'=>'Geen %1$sCSS%2$s bestanden toegevoegd','No %1$sJS%2$s files added'=>'Geen %1$sJS%2$s bestanden toegevoegd','Time to Live'=>'Time to Live','Alternative PHP Cache'=>'Alternatieve PHP cache','Always ignore the specified %1$sCSS%2$s files. Use relative paths. Omit: protocol, hostname, leading forward slash and query strings.'=>'Negeer altijd de opgegeven %1$sCSS%2$s bestanden. Gebruik relatieve paden. Weglaten: protocol, hostnaam, voorwaartse schuine streep en query strings.','Always ignore the specified %1$sJS%2$s files. Use relative paths. Omit: protocol, hostname, leading forward slash and query strings.'=>'Negeer altijd de opgegeven %1$sJS%2$s bestanden. Gebruik relatieve paden. Weglaten: protocol, hostnaam, voorwaartse schuine streep en query strings.','Best compatibility with %1$sIIS%2$s is realized via %3$sWinCache%4$s opcode cache.'=>'De beste compatibiliteit met %1$sIIS%2$s wordt gerealiseerd via %3$sWinCache%4$s opcode cache.','Install %1$sAPC%2$s module'=>'Installeer de %1$sAPC%2$s module','If disabled, %1$sCSS%2$s and %3$sJS%4$s embeddings will use GET variables instead of "fancy" links.'=>'Indien uitgeschakeld, gebruiken %1$sCSS%2$s en %3$sJS%4$s insluitingen GET variabelen in plaats van "fancy" links.','The %1$sTTL%2$s of page cache files is set via the "Expires header lifetime" field in the "Cascading Style Sheets &amp; JavaScript" section on %3$sBrowser Cache%4$s Settings tab.'=>'De %1$sTTL%2$s van pagina cache bestanden wordt ingesteld via het "Expires header lifetime" veld in de "Cascading style sheets & JavaScript" sectie op %3$sBrowser cache%4$s settings tab.','Enable %1$sHTTP%2$s compression in the "Cascading Style Sheets &amp; JavaScript" section on %3$sBrowser Cache%4$s Settings tab.'=>'Activeer %1$sHTTP%2$s compressie in de "Cascading style sheets & JavaScript" sectie op %3$sBrowser cache%4$s settings tab.','For better performance, send files to browser before they are requested when using the %1$sHTTP%2$s/2 protocol.'=>'Voor betere prestaties stuurt je bestanden naar de browser voordat ze worden opgevraagd bij gebruik van het %1$sHTTP%2$s/2 protocol.','%1$sOptional:%2$s On the "%3$sUser Agent Groups%4$s" tab, specify any user agents, like mobile phones if a mobile theme is used.'=>'%1$sOptioneel:%2$s geef op de tab "%3$sUser Agent Groups%4$s" eventuele user agents op, zoals mobiele telefoons als een mobiel thema wordt gebruikt.','%1$sRecommended:%2$s If you already have a content delivery network (%3$sCDN%4$s) provider, proceed to the "%5$sContent Delivery Network%6$s" tab and populate the fields and set your preferences. If you do not use the Media Library, you will need to import your images etc. into the default locations. Use the Media Library Import Tool on the "Content Delivery Network" tab to perform this task. If you do not have a %7$sCDN%8$s provider, you can still improve your site\'s performance using the "Self-hosted" method. On your own server, create a subdomain and matching %9$sDNS%10$s Zone record; e.g. static.domain.com and configure %11$sFTP%12$s options on the "Content Delivery Network" tab accordingly. Be sure to %13$sFTP%14$s upload the appropriate files, using the available upload buttons.'=>'%1$sAanbevolen:%2$s als je al een content delivery network (%3$sCDN%4$s) provider hebt, ga dan naar de "%5$sContent Delivery Network%6$s" tab en vul de velden in en stel je voorkeuren in. Als je de mediabibliotheek niet gebruikt, moet je je afbeeldingen enz. importeren in de standaard locaties. Gebruik de Media Library Import Tool op de "Content Delivery Network" tab om deze taak uit te voeren. Als je geen %7$sCDN%8$s provider hebt, kun je nog steeds de prestaties van je site verbeteren met de "Self hosted" methode. Maak op je eigen server een subdomein en bijbehorend %9$sDNS%10$s zone record aan, bijvoorbeeld static.domain.com en configureer %11$sFTP%12$s opties op de tab "Content Delivery Network". Zorg ervoor dat je %13$sFTP%14$s de juiste bestanden uploadt met behulp van de beschikbare upload knoppen.','%1$sRecommended:%2$s On the "%3$sBrowser Cache%4$s" tab, %5$sHTTP%6$s compression is enabled by default. Make sure to enable other options to suit your goals.'=>'%1$sAanbevolen:%2$s op de tab "%3$sBrowser cache%4$s" is %5$sHTTP%6$s compressie standaard ingeschakeld. Zorg ervoor dat je andere opties inschakelt, afhankelijk van je doelstellingen.','%1$sRecommended:%2$s On the "%3$sMinify%4$s" tab all of the recommended settings are preset. Use the help button to simplify discovery of your %5$sCSS%6$s and %7$sJS%8$s files and groups. Pay close attention to the method and location of your %9$sJS%10$s group embeddings. See the plugin\'s %11$s%12$sFAQ%13$s%14$s for more information on usage.'=>'%1$sAanbevolen:%2$s op de tab "%3$sMinify%4$s" staan alle aanbevolen instellingen ingesteld. Gebruik de hulpknop om je %5$sCSS%6$s en %7$sJS%8$s bestanden en groepen gemakkelijker te vinden. Let goed op de methode en locatie van je %9$sJS%10$s groep insluitingen. Zie de plugin\'s %11$s%12$s FAQ%13$s%14$s voor meer informatie over het gebruik.','Detailed information about each cache will be appended in (publicly available) %1$sHTML%2$s comments in the page\'s source code. Performance in this mode will not be optimal, use sparingly and disable when not in use.'=>'Gedetailleerde informatie over elke cache wordt toegevoegd in (publiekelijk beschikbare) %1$sHTML%2$s opmerkingen in de broncode van de pagina. De prestaties in deze modus zullen niet optimaal zijn, gebruik spaarzaam en schakel uit wanneer niet in gebruik.','If selected, detailed caching information will appear at the end of each page in a %1$sHTML%2$s comment. View a page\'s source code to review.'=>'Indien geselecteerd, verschijnt gedetailleerde caching informatie aan het einde van elke pagina in een %1$sHTML%2$s reactie. Bekijk de broncode van een pagina om te beoordelen.','Access Control List'=>'Toegangscontrole lijst','Specify the %1$sSNS%2$s topic.'=>'Geef het onderwerp %1$sSNS%2$s op.','Specify the %1$sAPI%2$s Key.'=>'Geef de %1$sAPI%2$s sleutel op.','Specify the %1$sAPI%2$s secret.'=>'Geef het %1$sAPI%2$s geheim op.','Network File System'=>'Netwerk bestandssysteem','Not recommended for %1$sNFS%2$s systems.'=>'Niet aanbevolen voor %1$sNFS%2$s systemen.','Enable %1$sHTTP%2$s compression and add headers to reduce server load and decrease file load time.'=>'Schakel %1$sHTTP%2$s compressie in en voeg headers toe om de server belasting te verminderen en de laadtijd van bestanden te verkorten.','Varnish Configuration Language'=>'Varnish configuratie taal','Notify of server configuration errors, if this option is disabled, the server configuration for active settings can be found on the %1$sinstall%2$s tab.'=>'Waarschuwen bij fouten in de server configuratie, als deze optie is uitgeschakeld, is de server configuratie voor actieve instellingen te vinden op de tab %1$sinstall%2$s.','Specify the IP addresses of your varnish instances above. The %1$sVCL%2$s\'s %3$sACL%4$s must allow this request.'=>'Geef hierboven de IP-adressen van je varnish instances op. De %1$sVCL%2$s%3$sACL%4$s moeten deze aanvraag toestaan.','Simple Notification Service'=>'Eenvoudige melding dienst','Optimize disk enhanced page and Minify disk caching for %1$sNFS%2$s'=>'Optimaliseer de pagina met verbeterde schijf en verklein de schijfcaching voor %1$sNFS%2$s',' (available after upgrade)'=>' (beschikbaar na upgrade)',' objects from