e statische bronnen, inclusief bronnen met een query string)','Edge cache TTL:'=>'Edge cache TTL:','Server side exclude:'=>'Serverzijde uitsluiting:','HyperText Markup Language'=>'HyperText Markup Language','Browser cache %1$sTTL%2$s:'=>'Browsercache %1$sTTL%2$s:','Query string sorting:'=>'Sorteren van query string:','Simplified (ignore the query string when delivering a cached resource)'=>'Vereenvoudigd (negeer de query string bij het leveren van een gegevensbron in de cache)','On (automatically run on the JavaScript resources on your site)'=>'Aan (automatisch uitgevoerd op de JavaScript gegevensbronnen op je site)','Encrypt email adresses on your web page from bots, while keeping them visible to humans. '=>'Versleutel e-mail adressen op je web pagina van bots, terwijl ze zichtbaar blijven voor mensen. ','Basic (cache most static resources (i.e., css, images, and JavaScript)'=>'Basis (cache de meeste statische gegevensbronnen (d.w.z. CSS, afbeeldingen en JavaScript)','Specify how long a visitor is allowed access to your site after successfully completing a challenge (such as a CAPTCHA). After the %1$sTTL%2$s has expired the visitor will have to complete a new challenge.'=>'Geef aan hoe lang een bezoeker toegang krijgt tot je site na het succesvol voltooien van een uitdaging (zoals een CAPTCHA). Nadat de %1$sTTL%2$s is verlopen zal de bezoeker een nieuwe uitdaging moeten voltooien.','Cloudflare may buffer the whole payload to deliver it at once to the client versus allowing it to be delivered in chunks.'=>'Cloudflare kan de hele lading bufferen om deze in één keer aan de client te leveren, in plaats van toe te staan dat deze in delen wordt afgeleverd.','If there is sensitive content on your website that you want visible to real visitors, but that you want to hide from suspicious visitors, all you have to do is wrap the content with Cloudflare SSE tags.'=>'Als er gevoelige inhoud op je site staat die je zichtbaar wilt maken voor echte bezoekers, maar die je wilt verbergen voor verdachte bezoekers, hoef je alleen maar de inhoud in te pakken met Cloudflare SSE tags.','How the content is cached by Cloudflare'=>'Hoe de inhoud wordt gecachet door Cloudflare','Development Mode temporarily allows you to enter development mode for your websites if you need to make changes to your site. This will bypass Cloudflare\'s accelerated cache and slow down your site, but is useful if you are making changes to cacheable content (like images, css, or JavaScript) and would like to see those changes right away.'=>'Ontwikkelmodus staat je tijdelijk toe om de ontwikkel modus voor je site in te gaan als je wijzigingen moet aanbrengen in je site. Dit omzeilt de versnelde cache van Cloudflare en vertraagt het je site, maar is handig als je wijzigingen aanbrengt in cachebare inhoud (zoals afbeeldingen, CSS of JavaScript) en die wijzigingen meteen wil zien.','Cloudflare will treat files with the same query strings as the same file in cache, regardless of the order of the query strings.'=>'Cloudflare behandelt bestanden met dezelfde query strings als hetzelfde bestand in de cache, ongeacht de volgorde van de query strings.','Cloudflare will prefetch any URLs that are included in the response headers.'=>'Cloudflare zal vooraf alle URL\'s ophalen die zijn opgenomen in de reactie headers.','%1$sCDN%2$s'=>'%1$sCDN%2$s','%1$sCDN%2$s host (%3$sCNAME%4$s target):'=>'%1$sCDN%2$s host (%3$sCNAME%4$s doel):','%1$sFSD%2$s %3$sCDN%4$s:'=>'%1$sFSD%2$s %3$sCDN%4$s:','%1$sSSL%2$s support:'=>'%1$sSSL%2$s ondersteuning:','Access Key:'=>'Toegangssleutel:','Access Secret:'=>'Toegangsgeheim:','Add new folder:'=>'Nieuwe map toevoegen:','currently set to %1$s%2$s%3$s will be changed to %4$s%5$s%6$s'=>'momenteel ingesteld op %1$s%2$s%3$s wordt gewijzigd in %4$s%5$s%6$s','Forward Cookies:'=>'Cookies doorsturen:','JavaScript'=>'JavaScript','Last 12 hours'=>'Laatste 12 uur','Last 24 hours'=>'Afgelopen 24 uur','Last 30 minutes'=>'Laatste 30 minuten','Last 6 hours'=>'Laatste 6 uur','