l geladen voor bezoekers van de site.','Flush Cloudflare on Post Modifications'=>'Cloudflare bij bericht modificaties opschonen','How many minutes data retrieved from Cloudflare should be stored. Minimum is 1 minute.'=>'Hoeveel minuten gegevens die uit Cloudflare zijn opgehaald, moeten worden opgeslagen. Minimaal 1 minuut.','Cloudflare extension is currently '=>'Cloudflare extensie is momenteel ','Enable when you have html pages cached on Cloudflare level.'=>'Inschakelen wanneer je HTML pagina\'s in de cache hebt op Cloudflare niveau.','%1$sCDN%2$s %3$sCNAME%4$s:'=>'%1$sCDN%2$s %3$sCNAME%4$s:','Bucket doesn\'t exist: %1$s.'=>'Bucket bestaat niet: %1$s.','Canonical Name'=>'Canonieke naam','Restricts the %1$sURL%2$ss which can be used as the target of form submissions from a given context.'=>'Beperkt de %1$sURL%2$ss die kan worden gebruikt als het doel van formulierinzendingen vanuit een bepaalde context.','Specifies valid sources for %1$sCSS%2$s stylesheets.'=>'Specificeert geldige bronnen voor %1$sCSS%2$s stylesheets.','One of:'=>'Een van:','Restricts the %1$sURL%2$ss which can be used in a document\'s &lt;base&gt; element.'=>'Beperkt de %1$sURL%2$ss die kunnen worden gebruikt in het &lt;basis&gt; element van een document.','Cascading Style Sheet'=>'Cascading Style Sheet','This optional field can be used to specify a %1$sURL%2$s that clients will send reports to if pin validation failures occur. The report is sent as a POST request with a JSON body.'=>'Dit optionele veld kan worden gebruikt om een %1$sURL%2$s op te geven waarnaar clients rapporten sturen als er pin validatie fouten optreden. Het rapport wordt verzonden als een BERICHT aanvraag met een JSON instantie.','This field is %1$salso required%2$s and represents your backup %3$sSPKI%4$s fingerprint. This pin is any public key not in your current certificate chain and serves as a backup in case your certificate expires or has to be revoked.'=>'Dit veld is %1$sook vereist%2$s en vertegenwoordigt je back-up %3$sSPKI%4$s vingerafdruk. Deze pincode is een openbare sleutel die niet in je huidige certificaatketen zit en dient als back-up voor het geval je certificaat verloopt of moet worden ingetrokken.','The Content Security Policy (%1$sCSP%2$s) header reduces the risk of %3$sXSS%4$s attacks by allowing you to define where resources can be retrieved from, preventing browsers from loading data from any other locations. This makes it harder for an attacker to inject malicious code into your site.'=>'De Content Security Policy %1$sCSP %2$s header verkleint het risico van %3$sXSS%4$s aanvallen doordat je kunt bepalen waar gegevensbronnen vandaan kunnen worden opgehaald, waardoor browsers geen gegevens van andere locaties kunnen laden. Dit maakt het voor een aanvaller moeilijker om kwaadaardige code in je site te injecteren.','Transport Layer Security'=>'Beveiliging van de transportlaag','%1$sHTTP%2$s Strict-Transport-Security (%3$sHSTS%4$s) enforces secure (%5$sHTTP%6$s over %7$sSSL%8$s/%9$sTLS%10$s) connections to the server. This can help mitigate adverse effects caused by bugs and session leaks through cookies and links. It also helps defend against man-in-the-middle attacks.  If there are %11$sSSL%12$s negotiation warnings then users will not be permitted to ignore them.'=>'%1$sHTTP%2$s strikte transportbeveiliging (%3$sHSTS%4$s) dwingt veilige (%5$sHTTP%6$s boven %7$sSSL%8$s /%9$sTLS%10$s) verbindingen met de server. Dit kan helpen om nadelige effecten te verminderen die worden veroorzaakt door bugs en sessielekken via cookies en links. Het helpt ook bij de verdediging tegen man-in-the-middle aanvallen. Als er %11$sSSL%12$s onderhandelingswaarschuwingen zijn, mogen gebruikers deze niet negeren.','Subject Public Key Information'=>'Onderwerp publieke sleutelinformatie','HTTP Public Key Pinning'=>'HTTP publieke sleutel vastzetten','HTTP Strict Transport Security'=>'HTTP Strict Transport Security','Secure Sockets Layer'=>'Secure Sockets Layer','This field is %1$srequired%2$s and represents a %3$sSPKI%4$s fingerprint. This pin is any public key within your current certificate chain.'=>'Dit veld is %1$srequired%2$s en vertegenwoordigt een %3$sSPKI%4$s vingerafdruk. Deze pin is elke publieke sleutel binnen je huidige certificaat keten.','%1$sHTTP%2$s Public Key Pinning (%3$sHPKP%4$s) is a security feature for %5$sHTTP%6$sS websites that can prevent fraudulently issued certificates from being used to impersonate existing secure websites.'=>'%1$sHTTP%2$s Public Key Pinning (%3$sHPKP%4$s) is een beveiligingsfunctie voor %5$sHTTP%6$sS sites die kunnen voorkomen dat frauduleus uitgegeven certificaten worden gebruikt om zich voor te doen als bestaande beveiligde sites.','Cross-Site Scripting'=>'Cross site scripting','Hypertext Transfer Protocol'=>'Hypertext Transfer Protocol','Quick Reference Chart'=>'Snelle referentiekaart','This setting prevents attacks that are caused by passing session IDs in %1$sURL%2$ss.'=>'Deze instelling voorkomt aanvallen die worden veroorzaakt door het doorgeven van sessie ID\'s in %1$sURL%2$ss.','Uniform Resource Locator'=>'Uniforme gegevensbron locator','%1$sHTTP%2$s security headers provide another layer of protection for your website by helping to mitigate attacks and security vulnerabilities.'=>'%1$sHTTP%2$s veiligheid headers bieden een extra beschermingslaag voor je site door aanvallen en beveiliging kwetsbaarheden te helpen beperken.','Minified JS Rocket Loader Exclude:'=>'Minified JS Rocket Loader uitsluiting:','Submitted'=>'Verzonden','Unable to connect to the filesystem (using %1$s). Please confirm your credentials.  %2$s'=>'Kan geen verbinding maken met het bestandssysteem (met %1$s). Bevestig je gegevens. %2$s','Images queued for conversion.  Progress can be seen in the %1$sMedia Library%2$s.'=>'Afbeeldingen in de wachtrij voor conversie. De voortgang is te zien in de %1$smediabibliotheek%2$s.','%1$sLearn more%2$s.'=>'%1$sMeer informatie%2$s.','Attachment id: '=>'Bijvoegsel id: ','Convert'=>'Converteer','Conv