. "\0" . '%1$u afbeeldingen ingediend voor verwerking.','The converted image would be larger than the original; conversion canceled.  %1$sLearn more%2$s.'=>'De geconverteerde afbeelding zou groter zijn dan het origineel; conversie geannuleerd. %1$sMeer informatie%2$s.','Reverting...'=>'Aan het terugzetten...','Adds the ability to convert images in the Media Library to the modern WebP format for better performance.'=>'Voegt de mogelijkheid toe om afbeeldingen in de mediabibliotheek te converteren naar het moderne WebP format voor betere prestaties.','Invalid API response.'=>'Ongeldige API reactie.','Invalid input image MIME type.'=>'Ongeldige invoer afbeelding MIME type.','Invalid output image MIME type.'=>'Ongeldige uitvoer afbeelding MIME type.','API error.  Please reload the page to try again,'=>'API fout. Herlaad de pagina om het opnieuw te proberen,','Total Cache WebP Converter has been activated. Now, you can %1$sadjust the settings%2$s or go to the %3$sMedia Library%2$s to convert images to WebP.  %4$sLearn more%2$s.'=>'Total Cache Image Service is geactiveerd. Nu kun je %1$sde instellingen aanpassen%2$s of naar de %3$sMediabibliotheek%2$s gaan om afbeeldingen naar WebP om te zetten. %4$sMeer informatie%2$s.','Detection of the below modules may not be possible on all environments. As such "Not detected" means that the environment disallowed detection for the given module which may still be installed/enabled whereas "Not installed" means the given module was detected but is not installed/detected.'=>'Detectie van de onderstaande modules is mogelijk niet in alle omgevingen mogelijk. Als zodanig betekent "Niet gedetecteerd" dat de omgeving niet is toegestaan detectie voor de gegeven module die nog steeds kan worden geïnstalleerd/ingeschakeld, terwijl "Niet geïnstalleerd" betekent dat de gegeven module is gedetecteerd maar niet is geïnstalleerd/gedetecteerd.','Threshold'=>'Drempel','The outer distance off the scrolling area from which to start loading the elements (example: 100px, 10%).'=>'De buitenste afstand van het scroll gebied van waaruit je de elementen wilt laden (bijvoorbeeld: 100px, 10%).','Controls whether or not the current document is allowed to use the Navigator.share() of Web Share API to share text, links, images, and other content to arbitrary destinations of user\'s choice, e.g. mobile apps.'=>'Bepaalt of het huidige document de Navigator.share() van Web Share API mag gebruiken om tekst, links, afbeeldingen en andere inhoud te delen met willekeurige bestemmingen naar keuze van de gebruiker, b.v. mobiele apps.','Controls whether the current document is allowed to use the WebVR API. When this policy is disabled, the Promise returned by Navigator.getVRDisplays() will reject with a DOMException. Keep in mind that the WebVR standard is in the process of being replaced with WebXR.'=>'Bepaalt of het huidige document de WebVR API mag gebruiken. Wanneer dit beleid is uitgeschakeld, wordt de door Navigator.getVRDisplays() geretourneerde belofte afgewezen met een DOME uitzondering. Houd er rekening mee dat de WebVR standaard wordt vervangen door WebXR.','Controls the availability of mechanisms that enables the page author to take control over the behavior of spatial navigation, or to cancel it outright.'=>'Beheert de beschikbaarheid van mechanismen waarmee de auteur van de pagina de controle over het gedrag van ruimtelijke navigatie kan overnemen, of dit volledig kan annuleren.','Controls whether the current document is allowed to use Screen Wake Lock API to indicate that device should not turn off or dim the screen.'=>'Bepaalt of het huidige document Screen Wake Lock API mag gebruiken om aan te geven dat het apparaat het scherm niet mag uitschakelen of dimmen.','Controls whether the current document is allowed to use the Gamepad API. When this policy is disabled, calls to Navigator.getGamepads() will throw a SecurityError DOMException, and the gamepadconnected and gamepaddisconnected events will not fire.'=>'Bepaalt of het huidige document de Gamepad API mag gebruiken. Wanneer dit beleid is uitgeschakeld, zullen oproepen naar Navigator.getGamepads() een SecurityError DOMEException veroorzaken en worden de gebeurtenissen gamepadconnected en gamepaddisconnected niet geactiveerd.','Controls whether the current document is allowed to use the Web Authentication API to retrieve already stored public-key credentials, i.e. via navigator.credentials.get({publicKey: ..., ...}).'=>'Bepaalt of het huidige document de Web Authentication API mag gebruiken om reeds opgeslagen inloggegevens voor de openbare sleutel op te halen, d.w.z. via navigator.credentials.get({publicKey: ..., ...}).','Controls whether the current document is allowed to trigger device vibrations via Navigator.vibrate() method of Vibration API.'=>'Bepaalt of het huidige document apparaat trillingen mag activeren via de methode Navigator.vibrate() van de Vibration API.','Controls whether tasks should execute in frames while they\'re not being rendered (e.g. if an iframe is hidden or display: none).'=>'Bepaalt of taken in frames moeten worden uitgevoerd terwijl ze niet worden weergegeven (bijvoorbeeld als een iframe is verborgen of wordt weergegeven: geen).','Controls whether tasks should execute in frames while they\'re outside of the visible viewport.'=>'Bepaalt of taken in frames moeten worden uitgevoerd terwijl ze zich buiten de zichtbare viewport bevinden.','Controls whether the use of the Battery Status API is allowed. When this policy is disabled, the Promise returned by Navigator.getBattery() will reject with a NotAllowedError DOMException.'=>'Bepaalt of het gebruik van de Battery Status API is toegestaan. Als dit beleid is uitgeschakeld, wordt de promise die door Navigator.getBattery() wordt geretourneerd, afgewezen met een NotAllowedError DOME uitzondering.','View detailed information about your site’s performance'=>'Bekijk gedetailleerde informatie over de prestaties van je site','Visualize your performance over time with graphs'=>'Visualiseer je prestaties over de tijd met grafieken','Examine the overall performance of caching method backends'=>'Onderzoek de algemene prestaties van caching method backends','Use %1$sinline%2$s method only when your website has just a few pages'=>'Gebruik de methode %1$sinline%2$s alleen als je site slechts een paar pagina\'s heeft','Lazy load google map'=>'Lazy-load Google Maps','Enable caching for wp-admin requests'=>'Schakel caching in voor wp-admin aanvragen','Store transients in database'=>'Transiënten in database opslaan','The duration of time in seconds to collect statistics per interval.'=>'De tijdsduur in seconden om statistieken per interval te verzamelen.','The number of intervals that are represented in the graph.'=>'Het aantal intervallen dat in de grafiek wordt weergegeven.','Webserver type generating access logs.'=>'Webserver type dat toegangslogs genereert.','Where your access log is located.'=>'Waar je toegangslog zich bevindt.','Format of your access log from webserver configuration.'=>'Format van je toegangslog uit webserver configuratie.','Users who upgrade to W3 Total Cache Pro will have access to the new Statistics page, which provides an in-depth view of the performance of your site.'=>'Gebruikers die upgraden naar W3 Total Cache Pro krijgen toegang tot de nieuwe statistiekenpagina, die een diepgaand overzicht biedt van de prestaties van je site.','Minify method:'=>'Verklein methode:','Allows policy management to be shared between a dynamic pool of servers. For example, each server in a pool to use opcode caching (which is not a shared resource) and purging is then synchronized between any number of servers in real-time; each server therefore behaves identically even though resources are not shared.'=>'Maakt het mogelijk om het beleidsbeheer te delen tussen een dynamische pool van servers. Bijvoorbeeld, elke server in een pool kan opcode caching gebruiken (wat geen gedeelde bron is) en het wissen wordt vervolgens in realtime gesynchroniseerd tussen een willekeurig aantal servers; elke server gedraagt zich dus identiek, ook al worden de bronnen niet gedeeld.','Preview mode:'=>'Voorbeeldmodus:','Secret key not specified.'=>'Geheime sleutel niet opgegeven.','Vote:'=>'Stemmen:','Or please share'=>'Of delen','CloudFront distribution not specified.'=>'CloudFront distributie niet gespecificeerd.','Africa (Cape Town)'=>'Afrika (Kaapstad)','China (Beijing)'=>'China (Peking)','Europe (Frankfurt)'=>'Europa (Frankfurt)','Europe (Stockholm)'=>'Europa (Stockholm)','Europe (Milan)'=>'Europa (Milaan)','Europe (Ireland)'=>'Europa (Ierland)','Europe (London)'=>'Europa (Londen)','Europe (Paris)'=>'Europa (Parijs)','Fix incorrect server document root path.  Uses the WordPress ABSPATH ("%1$s") in place of the current server document root ("%2$s").'=>'Herstel het onjuiste root pad van het server document. Gebruikt de WordPress ABSPATH ("%1$s") in plaats van de huidige server document root ("%2$s").','Fix document root path'=>'Los document root pad probleem op','Minify frequently asked questions'=>'Verklein veelgestelde vragen','Learn more'=>'Leer meer','Choosing a minification method'=>'Een minificatie methode kiezen','How to use Minify HTML'=>'Hoe Minify HTML te gebruiken','How to use manual Minify'=>'Hoe de handleiding voor Minify te gebruiken','%1$sPage Cache%2$s engine set to %1$s%3$s%2$s'=>'%1$sPagina cache%2$s engine ingesteld op %1$s%3$s%2$s','PRO FEATURE'=>'PRO FUNCTIE','Launch'=>'Opstarten','Page Caching using %1$s%2$s%3$s'=>'Paginacaching met %1$s%2$s%3$s','Setup Guide Wizard'=>'Installatiegids wizard','The Setup Guide wizard quickly walks you through configuring W3 Total Cache.'=>'De installatiegids wizard leidt je snel door het configureren van W3 Total Cache.','Defer loading offscreen Google Maps, making pages load faster.'=>'Stel het laden van Google Maps buiten het scherm uit, waardoor pagina\'s sneller worden geladen.','More info'=>'Meer informatie','Full Site Delivery via CDN'=>'Levering op volledige site via CDN','Eliminate Render Blocking CSS'=>'Elimineer renderblokkerende CSS','Render blocking CSS delays a webpage from being visible in a timely manner. Eliminate this easily with the click of a button in W3 Total Cache Pro.'=>'Renderblokkering van CSS zorgt ervoor dat een webpagina niet tijdig zichtbaar wordt. Elimineer dit eenvoudig met een klik op de knop in W3 Total Cache Pro.','Improve the performance of your Genesis, WPML powered site, and much more. StudioPress\' Genesis Framework is up to 60% faster with W3TC Pro.'=>'Verbeter de prestaties van je Genesis, door WPML aangedreven site en nog veel meer. Het Genesis Framework van StudioPress is tot 60% sneller met W3TC Pro.','Rest API Caching'=>'Rest API caching','Save server resources or add scale and performance by caching the WordPress Rest API with W3TC Pro.'=>'Bespaar serverbronnen of voeg schaal en prestaties toe door de WordPress Rest API te cachen met W3TC Pro.','Analytics for your WordPress and Server cache that allow you to track the size, time and hit/miss ratio of each type of cache, giving you the information needed to gain maximum performance.'=>'Analyse voor je WordPressen servercache waarmee je de grootte, tijd en hit/miss-verhouding van elk type cache kunt volgen, waardoor je de informatie krijgt die nodig is om maximale prestaties te behalen.','Purge Logs'=>'Opschoon logs','Purge Logs provide information on when your cache has been purged and what triggered it. If you are troubleshooting an issue with your cache being cleared, Purge Logs can tell you why.'=>'Opschoon logs geven informatie over wanneer je cache is opgeschoond en waardoor deze is geactiveerd. Als je een probleem met het wissen van je cache aan het oplossen bent, kan Purge Logs je vertellen waarom.','Page caching decreases the website response time, making pages load faster.'=>'Pagina caching vermindert de responstijd van de site, waardoor pagina\'s sneller worden geladen.','Defer loading offscreen images, making pages load faster.'=>'Stel het laden van offscreen-afbeeldingen uit, waardoor pagina\'s sneller worden geladen.','Host static files with a CDN to reduce page load time.'=>'Host statische bestanden met een CDN om de laadtijd van de pagina te verkorten.','Improves PHP performance by storing precompiled script bytecode in shared memory.'=>'Verbetert de PHP prestaties door de voorgecompileerde bytecode van het script op te slaan in het gedeelde geheugen.','Additional features to extend the functionality of W3 Total Cache, such as Accelerated Mobile Pages (AMP) for Minify and support for New Relic.'=>'Extra functies om de functionaliteit van W3 Total Cache uit te breiden, zoals Accelerated Mobile Pages (AMP) voor Minify en ondersteuning voor New Relic.','Manage cache groups for user agents, referrers, and cookies.'=>'Beheer cachegroepen voor user agents, verwijzers en cookies.','Cache Groups'=>'Cache groepen','Are you sure that you want to leave this page?'=>'Weet je zeker dat je deze pagina wil verlaten?','Content Delivery Network (CDN)'=>'Content Delivery Network (CDN)','Persistently store data to reduce post, page and feed creation time.'=>'Sla gegevens voortdurend op om de tijd voor het maken van berichten, pagina\'s en feeds te verminderen.','Reduce load time by decreasing the size and number of CSS and JS files.'=>'Verminder de laadtijd door de grootte en het aantal CSS en JS bestanden te verkleinen.','Persistently store objects to reduce execution time for common operations.'=>'Objecten permanent opslaan om de uitvoeringstijd voor veelvoorkomende bewerkingen te verminderen.','Feature Showcase'=>'Functie showcase','Extension Framework'=>'Extensie framework','Provide the best user experience possible by enhancing by hosting HTML pages and RSS feeds with (supported) CDN\'s high speed global networks.'=>'Bied de best mogelijke gebruikerservaring door te verbeteren door HTML pagina\'s en RSS feeds te hosten met (ondersteunde) snelle wereldwijde netwerken van CDN.','Unlocking the fragment caching module delivers enhanced performance for plugins and themes that use the WordPress Transient API.'=>'Het ontgrendelen van de fragment caching module levert verbeterde prestaties op voor plugins en thema\'s die de WordPress Transient API gebruiken.','UNKNOWN'=>'ONBEKEND','What\'s Next?'=>'Wat is het volgende?','Need help?'=>'Hulp nodig?','Pages containing images and other objects can have their load time reduced by deferring them until they are needed.  For example, images can be loaded when a visitor scrolls down the page to make them visible.'=>'De laadtijd van pagina\'s met afbeeldingen en andere objecten kan worden verkort door ze uit te stellen tot ze nodig zijn. Afbeeldingen kunnen bijvoorbeeld worden geladen wanneer een bezoeker naar beneden scrolt om ze zichtbaar te maken.','%1$sDatabase Cache%2$s engine set to %1$s%3$s%2$s'=>'%1$sDatabasecache%2$s engine ingesteld op %1$s%3$s%2$s','%1$sObject Cache%2$s engine set to %1$s%3$s%2$s'=>'%1$sObjectcache%2$s engine ingesteld op %1$s%3$s%2$s','%1$sBrowser Cache%2$s headers set for JavaScript, CSS, and images? %1$s%3$s%2$s'=>'%1$sBrowsercache%2$s headers ingesteld voor JavaScript, CSS en afbeeldingen? %1$s%3$s%2$s','%1$sLazy Load%2$s images? %1$s%3$s%2$s'=>'%1$sLazy-load%2$s afbeeldingen? %1$s%3$s%2$s','Your website\'s performance can still be improved by configuring %1$sminify%2$s settings, setting up a %1$sCDN%2$s, and more!'=>'De prestaties van je site kunnen nog steeds worden verbeterd door %1$sminify%2$s instellingen te configureren, een %1$sCDN%2$s in te stellen en meer!','Please visit %1$sGeneral Settings%2$s to learn more about these features.'=>'Ga naar %1$sAlgemene instellingen%2$s voor meer informatie over deze functies.','%1$sTime to First Byte%2$s has changed by %1$s%3$s%2$s'=>'%1$sTijd tot eerste byte%2$s is gewijzigd door %1$s%3$s%2$s','We\'re here to help you!  Visit our %1$sSupport Center%2$s for helpful information and to ask questions.'=>'We zijn er om je te helpen! Bezoek ons %1$sOndersteuningscentrum%2$s voor nuttige informatie en om vragen te stellen.','Setup Complete!'=>'Installatie afgerond!','Setting'=>'Instelling','can help ensure browsers are properly caching your assets.'=>'kan ervoor zorgen dat browsers je bestanden correct in het cachegeheugen plaatsen.','The %1$sCache-Control%2$s header tells your browser how it should cache specific files.  The %1$smax-age%2$s setting tells your browser how long, in seconds, it should use its cached version of a file before requesting an updated one.'=>'De %1$sCache-Control%2$s header vertelt je browser hoe deze specifieke bestanden moet cachen. De %1$smax-age%2$s instelling vertelt je browser hoe lang, in seconden, het moet de gecachte versie van een bestand gebruiken voordat een geüpdatete versie wordt aangevraagd.','To improve %1$sBrowser Cache%2$s, we recommend enabling %1$sBrowser Cache%2$s.'=>'Om %1$sBrowsercache%2$s te verbeteren, raden we aan %1$sBrowsercache%2$s in te schakelen.','Test Browser Cache'=>'Test browsercache','Cache-Control Header'=>'Cache-Control header','To render your website, browsers must download many different types of assets, including javascript files, CSS stylesheets, images, and more.  For most assets, once a browser has downloaded them, they shouldn\'t have to download them again.'=>'Om je site weer te geven, moeten browsers veel verschillende soorten items downloaden, waaronder JavaScript bestanden, CSS stylesheets, afbeeldingen en meer. Voor de meeste items hoeft een browser ze niet opnieuw te downloaden zodra ze deze heeft gedownload.','can help you speed up'=>'kan je helpen om te versnellen','The time it takes between a visitor\'s browser page request and receiving the first byte of a response is referred to as %1$sTime to First Byte%2$s.'=>'De tijd die nodig is tussen de aanvraag om een browserpagina van een bezoeker en het ontvangen van de eerste byte van een reactie, wordt %1$sTijd tot eerste byte%2$s genoemd.','Time to First Byte'=>'Tijd tot eerste byte','We\'ll test your homepage with Page Cache disabled and then with several storage engines.  You should review the test results and choose the best for your website.'=>'We zullen je homepage testen met Paginacache uitgeschakeld en vervolgens met verschillende opslag engines. Je moet de testresultaten bekijken en de beste voor je site kiezen.','Test Page Cache'=>'Testpagina cache','Measuring'=>'Meten','Select'=>'Selecteer','Storage Engine'=>'Opslag engine','Time (ms)'=>'Tijd (ms)','Testing'=>'Testen','By default, this feature is disabled.  We recommend using Redis or Memcached, otherwise leave this feature disabled as the server database engine may be faster than using disk caching.'=>'Standaard is deze functie uitgeschakeld. We raden het gebruik van Redis of Memcached aan, laat deze functie anders uitgeschakeld omdat de database engine van de server mogelijk sneller is dan het gebruik van schijf-caching.','WordPress caches objects used to build pages, but does not reuse them for future page requests.'=>'WordPress slaat objecten op die worden gebruikt om pagina\'s te bouwen, maar gebruikt ze niet opnieuw voor toekomstige pagina aanvragen.','can help you speed up dynamic pages by persistently storing objects.'=>'kan je helpen dynamische pagina\'s te versnellen door objecten voortdurend op te slaan.','Test Object Cache'=>'Objectcache testen','By allowing us to collect data about how W3 Total Cache is used, we can improve our features and experience for everyone. This data will not include any personally identifiable information.  Feel free to review our %1$sterms of use and privacy policy%2$s.'=>'Door ons toe te staan gegevens te verzamelen over hoe W3 Total Cache wordt gebruikt, kunnen we onze functies en ervaring voor iedereen verbeteren. Deze gegevens bevatten geen persoonlijk identificeerbare informatie. Bekijk gerust onze %1$sgebruiksvoorwaarden en privacybeleid%2$s.','Many database queries are made in every dynamic page request.  A database cache may speed up the generation of dynamic pages.  Database Cache serves query results directly from a storage engine.'=>'Veel database queries worden gemaakt in elke dynamische pagina-aanvraag. Een database cache kan het genereren van dynamische pagina\'s versnellen. Database cache serveert queryresultaten rechtstreeks vanuit een opslagmachine.','Test URL:'=>'Test URL:','SKIP'=>'OVERSLAAN','NEXT'=>'VOLGENDE','DASHBOARD'=>'DASHBOARD','Security violation'=>'Beveiligings overtreding','Invalid choice'=>'Ongeldige keuze','Not present'=>'Niet aanwezig','Unavailable'=>'Niet beschikbaar','Not Enabled'=>'Niet ingeschakeld','Welcome'=>'Welkom','Lazy Load'=>'Lazy-load','More Caching Options'=>'Meer caching opties','Requested cache storage engine is not available'=>'Aangevraagde cache opslag engine is niet beschikbaar','Requested cache storage engine is invalid'=>'Aangevraagde cache opslag engine is ongeldig','Testing complete.  Click Next to advance to the section and see the results.'=>'Testen afgerond. Klik op Volgende om naar de sectie te gaan en de resultaten te zien.','Could not perform this test.  Please reload the page to try again or click skip button to abort the setup guide.'=>'Kan deze test niet uitvoeren. Laad de pagina opnieuw om het opnieuw te proberen of klik op de knop Overslaan om de installatiehandleiding af te breken.','Could not update configuration.  Please reload the page to try again or click skip button to abort the setup guide.'=>'Kon configuratie niet updaten. Laad de pagina opnieuw om het opnieuw te proberen of klik op de knop Overslaan om de installatiehandleiding af te breken.','You have selected the Performance Suite that professionals have consistently ranked #1 for options and speed improvements.'=>'Je hebt de Performance Suite geselecteerd die professionals consequent als nummer 1 hebben gerangschikt voor opties en snelheidsverbeteringen.','provides many options to help your website perform faster.  While the ideal settings vary for every website, there are a few settings we recommend that you enable now.'=>'biedt veel opties om je site sneller te laten presteren. Hoewel de ideale instellingen voor elke site verschillen, zijn er een aantal instellingen die we je aanraden nu in te schakelen.','If you prefer to configure the settings on your own, you can %1$sskip this setup guide%2$s.'=>'Als je de instellingen liever zelf configureert, kan je %1$sdeze installatiehandleiding overslaan%2$s.','Settings not updated'=>'Instellingen niet geüpdatet','Settings updated'=>'Instellingen geüpdatet','By allowing us to collect data about how W3 Total Cache is used, we can improve our features and experience for everyone. This data will not include any personally identifiable information.%1$sFeel free to review our %2$sterms of use and privacy policy%3$s.'=>'Door ons toe te staan gegevens te verzamelen over hoe W3 Total Cache wordt gebruikt, kunnen we onze functies en ervaring voor iedereen verbeteren. Deze gegevens bevatten geen persoonlijk identificeerbare informatie.%1$sLees gerust onze %2$s gebruiksvoorwaarden en privacybeleid%3$s.','PREVIOUS'=>'VORIG','Setup Guide'=>'Installatiehandleiding','Welcome to the W3 Total Cache Setup Guide!'=>'Welkom bij de W3 Total Cache installatiegids!','Combine & Minify'=>'Combineer & Minimaliseren','Minify engine settings:'=>'Minimalisatie engine instellingen:','Minify only'=>'Alleen verkleinen','(required for gzip compression support)'=>'(vereist voor gzip compressie ondersteuning)','Please execute commands manually'=>'Voer de opdrachten handmatig uit','<strong>W3 Total Cache Error:</strong> Files and directories could not be automatically deleted.'=>'<strong>W3 Total Cache fout:</strong> bestanden en folders konden niet automatisch worden verwijderd.','or use FTP form to allow <strong>W3 Total Cache</strong> make it automatically.'=>'of gebruik het FTP formulier om <strong>W3 Total Cache</strong> het automatisch te laten maken.','New customer? Sign up now to speed up your site!'=>'Nieuwe klan