nnen voor afbeeldingen en favicons.','Limits the origins to which you can connect via XMLHttpRequest, WebSockets, and EventSource.'=>'Beperkt de oorsprong waar vandaan je kan verbinden via XMLHttpRequest, WebSockets, en EventSource.','Restricts the set of plugins that can be embedded into a document by limiting the types of resources which can be loaded.'=>'Beperk de set aan plugins die kan worden ingesloten in een document door de soort bronnen die kunnen worden geladen te beperken.','Specifies the origins that can serve web fonts.'=>'Specificeert de oorsprong die lettertypen kan aanleveren.','Restricts from where the protected resource can embed frames.'=>'Beperkt vanaf waar de beschermde bron frames kan insluiten.','Specifies valid sources for JavaScript.'=>'Specificeert geldige bronnen voor JavaScript.','Specifies valid sources for loading media using the &lt;audio&gt; and &lt;video&gt; elements.'=>'Specificeert geldige bronnen voor het laden van media met behulp van de elementen &lt;audio&gt; en &lt;video&gt;.','Yes = Don\'t Enforce HPKP'=>'Ja = Dwing HPKP niet af','No = Enforce HPKP'=>'Nee = Dwing HPKP af','Not Set'=>'Niet ingesteld','This header restricts the values of the Referer header in outbound links.'=>'Deze header beperkt de waarden van de verwijzende header in uitgaande links.','This instructs the browser to not MIME-sniff a response outside its declared content-type. It helps to reduce drive-by download attacks and stops sites from serving malevolent content that could masquerade as an executable or dynamic HTML file.'=>'Dit instrueert de browser om geen MIME-sniff op een antwoord te doen buiten het aangegeven inhoudstype. Het helpt drive-by download aanvallen te verminderen en voorkomt dat sites kwaadaardige inhoud aanbieden die jezelf zou kunnen voordoen als een uitvoerbaar of dynamisch HTML bestand.','This header enables the %1$sXSS%2$s filter. It helps to stop malicious scripts from being injected into your website. Although this is already built into and enabled by default in most browsers today it is made available here to enforce its reactivation if it was disabled within the user\'s browser.'=>'Deze header schakelt het filter %1$sXSS%2$s in. Het helpt om te voorkomen dat kwaadaardige scripts in je site worden geïnjecteerd. Hoewel dit al is ingebouwd in en standaard is ingeschakeld in de meeste browsers, wordt het hier beschikbaar gesteld om de reactivering ervan af te dwingen als het was uitgeschakeld in de browser van de gebruiker.','This tells the browser if it is permitted to render a page within a frame-like tag (i.e., &lt;frame&gt;, &lt;iframe&gt; or &lt;object&gt;). This is useful for preventing clickjacking attacks.'=>'Dit vertelt de browser of het is toegestaan ​​om een ​​pagina binnen een frame-achtige tag weer te geven (d.w.z. \'frame\', \'iframe\' of \'object\'). Dit is handig om clickjacking aanvallen te voorkomen.','This will prevent the user\'s session ID from being transmitted in plain text, making it much harder to hijack the user\'s session.'=>'Dit voorkomt dat de gebruikers sessie ID in platte tekst wordt verzonden, zodat het veel moeilijker is om de gebruikers sessie te kapen.','This tells the user\'s browser not to make the session cookie accessible to client side scripting such as JavaScript. This makes it harder for an attacker to hijack the session ID and masquerade as the effected user.'=>'Dit vertelt de browser van de gebruiker om de sessie cookie niet toegankelijk te maken voor client side scripting zoals JavaScript. Dit maakt het lastiger voor de aanvaller om de sessie ID te kapen en te vermommen als de getroffen gebruiker.','User Experience'=>'Gebruikerservaring','Disable Emoji'=>'Emoji\'s uitschakelen','Client id:'=>'Klant id:','Remove jquery-migrate support from your website front-end.'=>'Verwijder jQuery-migrate-ondersteuning van de front-end van je site.','Defer loading offscreen images.'=>'Stel het laden van offscreen afbeeldingen uit.','Client secret:'=>'Klant geheim:',