rms.'=>'Reacties die deze tekst bevatten niet verwijderen.','Admin Notification'=>'Beheerdersmelding','This tool will copy post or page attachments into the Media Library allowing WordPress to work as intended.'=>'Dit hulpmiddel kopieert bijlagen van berichten of pagina\'s in de afbeeldingsbibliotheek, zodat WordPress functioneert zoals bedoeld.','How many minutes data retrieved from New Relic should be stored. Minimum is 1 minute.'=>'Hoeveel minuten moeten gegevens van New Relic worden opgeslagen. Minimum is 1 minuut.','Redirect users to:'=>'Gebruikers omleiden naar:','Path to JAR file:'=>'Pad naar JAR bestand:','Restarting the web server will empty the opcode cache, which means it will have to be rebuilt over time and your site\'s performance will suffer during this period. Still, an opcode cache should be installed in any case to maximize WordPress performance.'=>'Bij herstart van de webserver wordt de opcode cache geleegd. Dit betekent dat deze opnieuw moet worden opgebouwd en dat de prestaties van je site gedurende die tijd lager liggen. Toch moet een opcode cache in ieder geval worden ingeschakeld om de prestaties van WordPress te maximeren.','Upload and replace the active settings file.'=>'Upload en vervang het actieve instellingenbestand.','Notify when minify cache creation errors occur.'=>'Bericht sturen als zich fouten voordoen bij maken van verklein cache.','Local Path'=>'Lokaal pad','Files to purge:'=>'Bestanden om op te schonen:','Purge queue'=>'Wachtrij opschonen','Purge queue is empty'=>'Opschoon wachtrij is leeg','Path to JAVA executable:'=>'Pad naar Java executable:','Merge selectors with the same properties (fast)'=>'Voeg selectors met dezelfde eigenschappen samen (snel)','Test Closure Compiler'=>'Test Closure compiler','Whitespace only'=>'Alléén witruimte','Other'=>'Andere','The groups above will be flushed upon setting changes.'=>'De bovenstaande groepen worden verwijderd bij wijzigingen in de instellingen.','symbols (set to 0 to disable)'=>'symbolen (0 is uitschakelen)','Test YUI Compressor'=>'Test YUI-compressor','In the case where Apache is not used, the .htaccess file located in the root directory of the WordPress installation, wp-content/w3tc/pgcache/.htaccess and wp-content/w3tc/min/.htaccess contain directives that must be manually created for your web server software.'=>'Daar waar Apache niet wordt gebruikt, het .htaccess in de root folder van de WordPress installatie wp-content/w3tc/pgcache/.htaccess en wp-content/w3tc/min/.htaccess bevat richtlijnen die je handmatig moet maken voor je web server software.','This tool lists the pending file uploads and deletions.'=>'Deze tool toont de wachtende bestand uploads en verwijderingen.','the specific file with its extension, with the specific parameters.'=>'het specifieke bestand met zijn extensie, met de specifieke parameters.','the specific file with its extension, and without parameters.'=>'het specifieke bestand met zijn extensie, zonder parameters.','the specific file (when the file does not have an extension), and without parameters.'=>'het specifieke bestand (als het bestand geen extensie heeft), zonder parameters.','all files in the directory with no extension, with all parameter variations.'=>'alle bestanden zonder extensie in de folder, met alle parameter variaties.','the directory itself (only when accessed directly without any file).'=>'de folder zelf (alléén direct benaderd dus zonder bestand).','Reduce server load by caching 404 pages. If the disk enhanced method of disk caching is used, 404 pages will be returned with a 200 response code. Use at your own risk.'=>'Verminder serverbelasting door 404 pagina\'s tijdelijk op te slaan. Als verbeterde schijfopslag wordt gebruikt voor tijdelijke opslag op schijf, dan worden 404 pagina\'s geleverd met antwoordcode 200. Gebruik voor je eigen risico.','Add the following directives to your .htaccess file or if there are several hundred they should be added directly to your configuration file:'=>'Voeg de volgende richtlijnen toe aan je .htaccess bestand of als het er meer dan honderd zijn voeg ze dan direct toe aan je configuratie bestand:','Enable file locking'=>'Schakel bestandsvergrendeling in','Try this option if your hosting environment uses a network based file system for a possible performance improvement.'=>'Probeer deze optie als je hostingomgeving een netwerkgebaseerd bestandssysteem gebruikt voor mogelijke prestatieverbetering.','Operations in areas:'=>'Operaties in gebieden:','Specify user agents that will never receive minified content.'=>'Specificeer user agents die nooit verkleinde inhoud zullen ontvangen.','Specify external files/libraries that should be combined.'=>'Specificeer externe bestanden/bibliotheken die moeten worden gecombineerd.','of user agents by specifying names in the user agents field. Assign a set of user agents to use a specific theme, redirect them to another domain or if an existing mobile plugin is active, create user agent groups to ensure that a unique cache is created for each user agent group. Drag and drop groups into order (if needed) to determine their priority (top -&gt; down).'=>'van user agents door namen op te geven in het user agents veld. Wijs een set user-agents toe om een ​​specifiek thema te gebruiken, stuur ze door naar een ander domein of maak, als een bestaande mobiele plugin actief is, user-agents-groepen om ervoor te zorgen dat voor elke user-agent-groep een unieke cache wordt gemaakt. Sleep groepen in de juiste volgorde (indien nodig) om hun prioriteit te bepalen (van boven naar beneden).','Assign this group of user agents to a specific theme. Selecting "Pass-through" allows any plugin(s) (e.g. mobile plugins) to properly handle requests for these user agents. If the "redirect users to" field is not empty, this setting is ignored.'=>'Wijs deze groep user agents toe aan een specifiek thema. Door "Pass-through" te selecteren, kunnen plugins (bijv. Mobiele plugins) aanvraagen voor deze user agents correct afhandelen. Als het "redirect users to" veld niet leeg is, wordt deze instelling genegeerd.','User agents:'=>'User agents:','Per the above, make sure that visitors are notified about the cookie as per any regulations in your market.'=>'Zorg ervoor dat bezoekers volgens het bovenstaande worden geïnformeerd over de cookie volgens de voorschriften in je markt.','Application Settings'=>'Applicatie instellingen','Behavior Settings'=>'Gedragsinstellingen','This is required when using New Relic on a network install to set the proper names for sites.'=>'Dit is vereist bij het gebruik van New Relic op een netwerkinstallatie om de juiste namen voor sites in te stellen.','Groups that should not be cached.'=>'Groepen die niet in de cache mogen worden opgeslagen.','Page caching via %1$s is currently %2$s'=>'Paginacaching via %1$s is momenteel %2$s','Search result (and similar) pages will be cached if enabled.'=>'Pagina\'s met zoekresultaten (en soortgelijke) worden in de cache opgeslagen indien ingeschakeld.','Specify a regular expression that matches your sitemaps.'=>'Geef een reguliere expressie op die overeenkomt met je sitemaps.','Enables support for WordPress functionality in fragment caching for the page caching engine. Use of this feature may increase response times.'=>'Biedt ondersteuning voor WordPress-functionaliteit bij fragmentcaching voor de pagina-caching engine. Het gebruik van deze functie kan de reactietijd verlengen.','Reject HEAD requests:'=>'HEAD aanvragen afwijzen:','Never send cache pages for these user agents.'=>'Stuur nooit cachepagina\'s voor deze user agents.','Specify additional page headers to cache.'=>'Specificeer extra paginaheaderen om te cachen.','-- Pass-through --'=>'- Doorvoer -','Assign this group of referrers to a specific theme. Selecting "Pass-through" allows any plugin(s) (e.g. referrer plugins) to properly handle requests for these referrers. If the "redirect users to" field is not empty, this setting is ignored.'=>'Wijs deze groep verwijzers toe aan een specifiek thema. Door "Pass-through" te selecteren, kunnen plugins (bijv. Verwijzende plugins) aanvraagen voor deze verwijzers correct afhandelen. Als het "redirect users to" veld niet leeg is, wordt deze instelling genegeerd.','Referrers:'=>'Verwijzers:','Compatibility mode:'=>'Compatibiliteitsmodus:','Consider using memcached for objects that must persist across web server restarts or that you wish to share amongst your server pool, e.g.: database objects or page cache.'=>'Overweeg memcached voor objecten te gebruiken die moeten blijven na een server herstart of die je wil delen over je server pool, b.v.: database objecten of pagina cache.','Cache the specified pages even if they don\'t have trailing slash.'=>'Cache de opgegeven pagina\'s zelfs als ze geen slash aan het einde hebben.','Purge Policy: '=>'Opschoon beleid: ','Select user roles that should not receive cached pages:'=>'Selecteer gebruikersrollen die geen pagina\'s in de cache mogen ontvangen:','Specify additional pages to purge. Including parent page in path. Ex: parent/posts.'=>'Geef extra pagina\'s op om te verwijderen. Inclusief hoofd pagina in pad. Ex: parent/post.','Specify the interval between download and update of external files in the minify cache. Hint: 6 hours is 21600 seconds. 12 hours is 43200 seconds. 24 hours is 86400 seconds.'=>'Specificeer het interval tussen het downloaden en updaten van externe bestanden in de verkleiningscache. Tip:6 uur is 21600 seconden. 12 uur is 43200 seconden. 24 uur is 86400 seconden.','Total posts:'=>'Totaal aantal berichten:','%1$sOptional:%2$s On the "%3$sObject Cache%4$s" tab the recommended settings are preset. If using a shared hosting account use the "disk" method with caution, the response time of the disk may not be fast enough, so this option is disabled by default. Test this option with and without database cache to ensure that it provides a performance increase.'=>'%1$sOptioneel:%2$s Op de tab "%3$sObject cache%4$s" zijn de aanbevolen instellingen vooraf ingesteld. Als je een gedeeld hostingaccount gebruikt om voorzichtig te zijn met de methode \'schijf\', is de reactietijd van de schijf mogelijk niet snel genoeg, dus deze optie is standaard uitgeschakeld. Test deze optie met en zonder databasecache om er zeker van te zijn dat deze een prestatieverbetering oplevert.','On the "%1$sGeneral%2$s" tab and select your caching methods for page, database and minify. In most cases, "disk enhanced" mode for page cache, "disk" mode for minify and "disk" mode for database caching are "good" settings.'=>'Ga naar de tab "%1$sAlgemeen%2$s" en selecteer je caching methoden voor pagina, database en verkleinen. In de meeste gevallen zijn de "disk enhanced" modus voor pagina cache, "disk" modus voor verkleining en "disk" modus voor database caching "goede" instellingen.','%1$sOptional:%2$s On the "%3$sDatabase Cache%4$s" tab the recommended settings are preset. If using a shared hosting account use the "disk" method with caution; in either of these cases the response time of the disk may not be fast enough, so this option is disabled by default.'=>'%1$sOptioneel:%2$s Op de tab "%3$sDatabase cache%4$s" zijn de aanbevolen instellingen vooraf ingesteld. Als je een gedeeld hostingaccount gebruikt, gebruik dan de "disk" methode met de nodige voorzichtigheid; in beide gevallen is de reactietijd van de schijf mogelijk niet snel genoeg, dus deze optie is standaard uitgeschakeld.','1. The "Compatibility Mode" option found in the advanced section of the %1$s"Page Cache Settings"%2$s tab will enable functionality that optimizes the interoperablity of caching with WordPress, is disabled by default, but highly recommended. Years of testing in hundreds of thousands of installations have helped us learn how to make caching behave well with WordPress. The tradeoff is that disk enhanced page cache performance under load tests will be decreased by ~20%% at scale.'=>'1. De optie "Compatibiliteitsmodus" in de geavanceerde sectie van de tab %1$s"Pagina cache instellingen"%2$s schakelt functionaliteit in die de interoperabliteit van caching met WordPress optimaliseert, is standaard uitgeschakeld, maar wordt ten zeerste aanbevolen. Jaren van testen in honderdduizenden installaties hebben ons geholpen te leren hoe we caching goed kunnen laten werken met WordPress. De afweging is dat de prestaties van de disk enhanced pagina cache onder belastingtests op schaal met ~20%% zullen afnemen.','Enabling this option will increase load on server on certain actions but will guarantee that the Object Cache is always clean and contains latest changes. %1$sEnable if you are experiencing issues with options displaying wrong value/state (checkboxes etc).%2$2'=>'Als je deze optie inschakelt, wordt de server meer belast met bepaalde acties, maar wordt gegarandeerd dat de object cache altijd schoon is en de nieuwste wijzigingen bevat. %1$sInschakelen als je problemen ondervindt met opties die een verkeerde waarde/status weergeven (selectievakjes enz.).%2$2','Application settings could not be retrieved. New Relic may not be properly configured, %1$sreview the settings%2$s.'=>'Applicatie instellingen kunnen niet worden opgehaald. New Relic is mogelijk niet goed geconfigureerd, %1$sbekijk de instellingen%2$s.','Forum Topic URL: '=>'URL van forumonderwerp: ','Subject: '=>'Onderwerp: ','Phone: '=>'Telefoon: ','E-Mail: '=>'E-mail: ','Always ignore the specified pages / directories. Supports regular expressions (See %1$s%2$sFAQ%3$s%4$s)'=>'Negeer altijd de opgegeven pagina\'s/folders. Ondersteunt reguliere expressies (zie %1$s%2$sFAQ%3$s%4$s)','Remove objects from the %1$sCDN%2$s by specifying the relative path on individual lines below and clicking the "Purge" button when done. For example:'=>'Verwijder objecten uit de %1$sCDN%2$s door het relatieve pad op afzonderlijke regels hieronder op te geven en op de knop "Leegmaken" te klikken wanneer je klaar bent. Bijvoorbeeld:','Authenticated users will not receive minified pages if this option is enabled.'=>'Geverifieerde gebruikers ontvangen geen verkleinde pagina\'s als deze optie is ingeschakeld.','By default the front page is cached when using static front page in reading settings.'=>'Standaard wordt de voorpagina in de cache opgeslagen bij gebruik van statische voorpagina in leesinstellingen.','Charset:'=>'Tekenset:','Debug mode:'=>'Foutopsporingsmodus:','Download the active settings file.'=>'Download het actieve instellingenbestand.','Groups shared amongst sites in network mode.'=>'Groepen gedeeld tussen sites in netwerkmodus.','Last response:'=>'Laatste reactie:','Limit the number of pages to create per batch. Fewer pages may be better for under-powered servers.'=>'Beperk het aantal pagina\'s dat per batch moet worden gemaakt. Minder pagina\'s zijn misschien beter voor servers met een te laag vermogen.','Low (higher readability)'=>'Laag (hogere leesbaarheid)','Minify via %1$s is currently %2$s.'=>'Verkleinen via %1$s is momenteel %2$s.','Never cache pages that use the specified cookies.'=>'Cache nooit pagina\'s die de opgegeven cookies gebruiken.','No groups have been registered.'=>'Er zijn geen groepen geregistreerd.','Reset configuration:'=>'Configuratie resetten:','Restore Default Settings'=>'Standaard instellingen terugzetten','Specify the referrers for this group. Remember to escape special characters like spaces, dots or dashes with a backslash. Regular expressions are also supported.'=>'Geef de verwijzers voor deze groep op. Vergeet niet om speciale tekens zoals spaties, punten of streepjes te escapen met een backslash. Reguliere expressies worden ook ondersteund.','Specify the user agents for this group. Remember to escape special characters like spaces, dots or dashes with a backslash. Regular expressions are also supported.'=>'Specificeer de user agents voor deze groep. Vergeet niet om speciale tekens zoals spaties, punten of streepjes te escapen met een backslash. Reguliere expressies worden ook ondersteund.','Standard