hes the single post / page loop, pagination is supported.'=>'Caches de enkele bericht/pagina loop, paginatie wordt ondersteund.','FTP credentials don\'t allow to chmod '=>'FTP inloggegevens staan chmod niet toe ','FTP credentials don\'t allow to delete '=>'FTP inloggegevens staan niet toe om te verwijderen ','FTP credentials don\'t allow to delete folder '=>'FTP inloggegevens staan niet toe om folder te verwijderen ','List of pages / posts that should not have the single post / post loop cached. Specify one page / post per line. This area supports regular expressions.'=>'Lijst van pagina\'s/berichten waarvan de enkele bericht/bericht loop niet moet worden gecached. Geef één pagina/bericht per regel op. Dit gebied ondersteund reguliere uitdrukkingen.','List of pages that should not have sidebar cached. Specify one page / post per line. This area supports regular expressions.'=>'Lijst van pagina\'s waarvan de zijbalk niet gecached moet zijn. Geef één pagina/bericht per regel op. Dit gebied ondersteund reguliere uitdrukkingen.','Minification'=>'Minificatie','My Websites'=>'Mijn sites','On:'=>'Aan:','enabled'=>'ingeschakeld','User experience is an important aspect of every web site and all web sites can benefit from effective caching and file size reduction. We have applied web site optimization methods typically used with high traffic sites and simplified their implementation. Coupling these methods either %1$s and/or opcode caching and the %2$sCDN%3$s of your choosing to provide the following features and benefits:'=>'Gebruikerservaring is een belangrijk aspect van elke site en alle sites kunnen profiteren van effectieve caching en verkleining van de bestandsgrootte. We hebben site optimalisatiemethoden toegepast die meestal worden gebruikt bij sites met veel verkeer en de implementatie ervan vereenvoudigd. Het koppelen van deze methoden ofwel %1$s en/of opcode caching en de %2$sCDN%3$s van je keuze om de volgende functies en voordelen te bieden:','Caching of pages / 