flare','%1$sCloudflare plugin detected. We recommend removing the plugin as it offers no additional capabilities when W3 Total Cache is installed. This message will disappear when Cloudflare is removed. %2$s%3$s'=>'%1$sCloudflare plugin gedetecteerd. We raden aan de plugin te verwijderen, omdat deze geen extra mogelijkheden biedt wanneer W3 total cache is geïnstalleerd. Dit bericht verdwijnt wanneer Cloudflare wordt verwijderd. %2$s%3$s']];